INSERT INTO `berita` VALUES
(5,NULL,'Kunjungan Studi Bagian Hukum Kabupaten Wonosobo','Kunjungan Studi Bagian Hukum Kabupaten Wonosobo','kunjungan-studi-bagian-hukum-kabupaten-wonosobo','<p style=\"text-align: justify;\">Senin, 30 September 2024 bertempat di Perpustakaan Bagian Hukum Setda Kabupaten Banjarnegara, Bagian Hukum Setda Kabupaten Banjarnegara menerima kunjungan Studi Komparasi Bagian Hukum Setda Kabupaten Wonosobo. Kegiatan ini dimaksudkan agar mendapatkan gambaran tentang pengkoordinasian penyusunan, penetapan dan evaluasi peraturan perundang-undangan, pemberian dan koordinasi bantuan hukum dan hak asasi manusia Bagian Hukum Setda Kabupaten Banjarnegara.<p><img style=\"text-align: justify;\" width=\"432\" height=\"324\" src=\"/berita/image_1729480098_0.webp\"></p><p style=\"text-align: justify;\">Tim Bagian Hukum Setda Kabupaten Wonosobo diterima oleh Bapak Syahbudin Usmoyo, S.H. selaku Kepala Bagian Hukum, dalam kunjungan tersebut banyak berdiskusi mengenai pengelolaan JDIH dan beberapa pertanyaan mencakup tahapan penyusunan produk hukum dengan kepala daerah yang dipimpin oleh Pj atau penjabat&nbsp; sementara yang ditunjuk untuk mengisi kekosongan jabatan kepala daerah.&nbsp;</p></p>\n',NULL,'WhatsApp Image 2024-09-30 at 12.55.52.webp',108,'list','Tia','2024-10-21 03:08:19',1,'2024-09-30'),
(6,NULL,'Rapat Koordinasi Pengelola Jaringan Dokumentasi dan Informasi Hukum Provinsi Jawa Tengah','Rapat Koordinasi Pengelola Jaringan Dokumentasi dan Informasi Hukum Provinsi Jawa Tengah','rapat-koordinasi-pengelola-jaringan-dokumentasi-dan-informasi-hukum-provinsi-jawa-tengah','<p style=\"text-align: justify;\">Semarang, 17 Juli 2024 Bertempat di Gedung Gradika Bakti Praja Setda Provinsi Jawa Tengah diselenggarakan Rapat Koordinasi Pengelola Jaringan Dokumentasi dan Informasi Hukum Provinsi Jawa Tengah Tahun 2024 dengan tema \" Membangun SDM Pengelola JDIH yang berkualitas dan Strategi Optimalisasi Pengelolaan Dokumen Hukum yang terintegrasi pada JDIHN\". Acara dihadiri seluruh anggota Pengelola JDIH Bagian Hukum dan Sekretariat DPRD Kabupaten/Kota, perwakilan Perguruan Tinggi di Jawa Tengah dan OPD Tim Pengelola JDIH yakni Kanwil Kemenkumhan, Kominfo, Dinas Arpus dan Dispermades serta dari Sekretariat Dewan Provinsi Jawa Tengah.<p style=\"text-align: justify;\">Kegiatan&nbsp;penyerahan penghargaan pengelola JDIH terbaik kapada 5 (lima) pengelola JDIH pada bagian hukum Kabupaten/Kota, yaitu terbaik 1 Kabupaten Sukoharjo, Terbaik II Kota Semarang, Terbaik III Kabupaten Batang, Terbaik IV Kabupaten Magelang dan Terbaik V Kabupaten Wonosobo. Pemberian penghargaan juga diberikan kepada Kabupaten Rembang sebagai pengelolaan JDIH dengan progres pencapaian terbaik.</p><p style=\"text-align: justify;\">Hadir sebagai narasumber dalam kegiatan Rakor ini, Diden Priya Utama dan Sudino yang keduanya merupakan pengelola JDIHN pada kantor BPHN Kemenkumham RI dan dipandu oleh Moderator Dyah Santi dari Kanwil Kumham Jawa Tengah.</p></p>\n',NULL,'WhatsApp Image 2024-07-17 at 14.18.14 (2) (1).webp',63,'list','Tia','2024-10-22 02:20:43',1,'2024-07-17'),
(7,NULL,'Fasilitasi Rancangan Peraturan Daerah (Raperda) Kabupaten Banjarnegara','Fasilitasi Rancangan Peraturan Daerah (Raperda) Kabupaten Banjarnegara','fasilitasi-rancangan-peraturan-daerah-(raperda)-kabupaten-banjarnegara','<p style=\"text-align: justify;\"><strong>Semarang (4 Juli 2024),</strong> Bagian Hukum bersama dengan Biro Hukum Sekretariat Daerah (Setda) Provinsi Jawa Tengah melaksanakan Rapat Fasilitasi Rancangan Peraturan Daerah Kabupaten Banjarnegara. Bertempat di Ruang Rapat Biro Hukum Setda Provinsi Jawa Tengah, kegiatan ini dihadiri oleh unsur Pemerintah Provinsi Jawa Tengah dan Pemerintah Kabupaten Banjarnegara.<p style=\"text-align: justify;\">Fasilitasi 4 (empat) Rancangan Peraturan Daerah Kabupaten Banjarnegara yang diantaranya Raperda tentang Fasilitasi Pondok Pesantren, Raperda tentang Pemberian Insentif dan Kemudahan Berinvestasi, Raperda tentang Penyertaan Modal Daerah pada Badan Usaha Milik Daerah, Raperda tentang Perusahaan Daerah Aneka Usaha.</p></p>\n',NULL,'WhatsApp Image 2024-07-04 at 10.59.14.webp',64,'list','T','2024-10-23 01:35:12',1,'2024-07-04'),
(8,NULL,'Pembinaan Anggota JDIH Kelurahan/Desa Tahun 2024','Pembinaan Anggota JDIH Kelurahan/Desa Tahun 2024','pembinaan-anggota-jdih-kelurahan/desa-tahun-2024','<p style=\"text-align: justify;\"><strong>Banjarnegara, 18 Juli 2024</strong> Bagian Hukum Sekretariat Daerah (Setda) Kabupaten Banjarnegara sebagai Pusat JDIH Kabupaten Banjarnegara melaksanakan kunjungan kerja ke 12 (dua belas) kelurahan dalam rangka sosialisasi dan monitoring Anggota JDIH tingkat Desa/Kelurahan di Kabupaten Banjarnegara. Ke-12 Kelurahan yang dikunjungi anatara lain Kutabanjarnegara, Semampir, Argasoka, Karangtengah, Krandegan, Parakancanggah, Semarang, Sokanandi, Wangon, Kenteng, Rejasa, dan Kalibenda.<p style=\"text-align: justify;\">Sesuai dengan Peraturan Bupati Nomor 43 Tahun 2023 tentang Jaringan Dokumentasi dan Informasi Hukum diamanatkan bahwa Bagian Hukum selaku Pusat JDIH memiliki tugas untuk merumuskan kebijakan pembinaan dan pengembangan JDIH Kabupaten Banjarnegara. Salah satu kegiatan pengembangan yang diupayakan antara lain mengumpulkan, mengolah, menyimpan, melestarikan, dan mendayagunakan Dokumen Hukum yang diterbitkan ditingkat Kelurahan/Desa.</p><p style=\"text-align: justify;\">Melalui&nbsp;monitoring dan sosialisasi ini, diharapkan membangun kerjasama kepada seluruh perangkat daerah termasuk kelurahan/desa dalam meningkatkan kualitas dan kuantitas dokumen hukum di semua anggota JDIH perlu dilakukan secara berkelanjutan. Dengan dokumen hukum yang terus dilakukan pembaruan dan metdata yang disesuikan dengan Peraturan Menteri Hukum dan HAM Nomor 8 Tahun 2019 tentang Standar Pengelolaan Dokumen dan Informasi Hukum, maka akan semakin melengkapi dan memperbaiki kualitas Basis Data Hukum Kabupaten Banjarnegara sebagai wadah untuk mengakses informasi hukum di kalangan masyarakat.&nbsp;</p></p>\n',NULL,'WhatsApp Image 2024-10-23 at 09.12.56.webp',NULL,'list','t','2024-10-23 02:19:50',1,'2024-07-18'),
(9,NULL,'Studi Komparasi Pengelolaan JDIH di Kabupaten Wonosobo','Studi Komparasi Pengelolaan JDIH di Kabupaten Wonosobo','studi-komparasi-pengelolaan-jdih-di-kabupaten-wonosobo','<p style=\"text-align: justify;\"><strong>Banjarnegara, 26 Juli 2024 </strong>Bagian Hukum Sekretariat Daerah (Setda) Kabupaten Banjarnegara melakukan kunjungan ke Bagian Hukum Setda Kabupaten Wonosobo dalam rangka meningkatkan pengelolaan Jaringan Dokumentasi dan Informasi Hukum (JDIH) Kabupaten Wonosobo. Kepala Bagian Hukum Setda Kabupaten Wonosobo, Nurwahid menerima secara langsung kunjungan dan untuk melakukan diskusi terkait pengelolaan JDIH.<p style=\"text-align: justify;\">Maksut dari kunjungan ini adalah&nbsp;<em>sharing knowledge&nbsp;</em>terkait pengelolaan JDIH. Beberapa hal yang dibahas pada kunjungan ini antara lain pengelolaan dan pengembangan&nbsp;<em>website</em> JDIH, pembinaan anggota JDIH tingkat desa/kelurahan di Kabupaten Wonosobo, sarana prasarana serta inovasi.</p><p style=\"text-align: justify;\">Dengan kegiatan studi komparasi pengelolaan JDIH Kabupaten Wonosobo dan Kabupaten Banjarnegara diharapkan dapat memberikan manfaat dalam upaya peningkatan layanan dan pengelolaan JDIH di masing-masing instansi.<img src=\"WhatsApp%20Image%202024-07-31%20at%2008.37.31\" alt=\"\"></p></p>\n',NULL,'WhatsApp Image 2024-07-31 at 08.38.21.webp',161,'list','-','2024-10-23 06:58:44',1,'2024-07-26'),
(10,NULL,'Konsultasi Tata Kelola Kebijakan Publik di LAN (Lembaga Administrasi Negara)','Konsultasi Tata Kelola Kebijakan Publik di LAN (Lembaga Administrasi Negara)','konsultasi-tata-kelola-kebijakan-publik-di-lan-(lembaga-administrasi-negara)','<p style=\"text-align: justify;\"><strong>Jakarta, 10 Juli 2024</strong> Konsultasi Pelaksanaan Tata Kelola Kebijakan Publik diterima oleh Bapak Aldino Analis Kebijakan Muda Lembaga Administrasi Negara. Pengukuran Indek Kualitas Kebijakan (IKK) mendasarkan pada Peraturan Menteri PANRB Nomor 3 Tahun 2023 tentang Perubahan Atas Peraturan Menteri PANRB Nomor 25 Tahun 2020 tentang Road Map Reformasi Birokrasi 2020 &ndash; 2024 yang menetapkan di dalamnya Indeks Reformasi Hukum (IRH) dan Indeks Kualitas Kebijakan (IKK).<p style=\"text-align: justify;\">Pengukuran IKK akan menghasilkan profil kualitas kebijakan pada seluruh Instansi Pemerintah baik Kemeterian/-Lembaga/Pemerintah Daerah, yang selanjutnya akan&nbsp; dimanfaatkan untuk mengembangkan strategi peningkatan kualitas kebijakan bagi Pemerintah.</p><p style=\"text-align: justify;\">Tujuan pengukuran IKK adalah untuk mendorong penguatan partisipasi publik dan prinsip-prinsip tata kelola yang baik dalam proses pembuatan kebijakan publik, khususnya dalam membangun kebijakan berbasis bukti (evidence-based policy).<img width=\"393\" height=\"295\" src=\"/berita/image_1730080700_0.webp\"></p><p style=\"text-align: justify;\">IKK adalah instrument untuk menilai kualitas kebijakan dilihat dari proses kebijakan dan bagaimana melakukan pengelolaan agenda, formulasi, implementasi dan proses evaluasi.</p><p style=\"text-align: justify;\">Pelaksanaan Pengukuran IKK :</p><p style=\"text-align: justify;\">1) Pelaksanaan nasional yang wajib diikuti oleh seluruh Instansi dilakukan setiap 2 tahun sekali, telah dilaksanakan secara nasional tahun 2021 dan 2023;</p><p style=\"text-align: justify;\">2) Pengukuran tahun 2024 bersifat opsional dengan prioritas bagi instansi yang belum mengukur IKK 2023 dan atau Instansi yang masih meraih predikat cukup dan kurang dari pengukuran IKK sebelumnya</p><p style=\"text-align: justify;\">3) Pengukuran dilakukan dengan menggunakan Sistem Informasi IKK pada ikk.lan.go.id.</p><p style=\"text-align: justify;\">Kriteria populasi kebijakan dalam pengukuran IKK yaitu Perda dan Perkada dengan menggunakan kriteria :&nbsp;</p><p style=\"text-align: justify;\">1) Perda dan Perkada yang ditetapkan dalam kurun waktu 3 (tiga) tahun sebelum tahun pengukuran.</p><p style=\"text-align: justify;\">2) Perda dan Perkada yang telah diimplementasikan paling singkat 1 (satu) tahun dari waktu pengukuran IKK.</p><p style=\"text-align: justify;\">Kebijakan yang dikecualikan sebagai obyek pengukuran kualitas kebijakan :</p><p style=\"text-align: justify;\">1) Kebijakan yang sifatnya rutin ditetapkan berdasarkan berdasarkan periodisasi tertentu.</p><p style=\"text-align: justify;\">2) Kebijakan yang sifatnya mengatur kedalam/internal instansi</p><p style=\"text-align: justify;\">Indikator hasil pengukuran IKK :</p><p style=\"text-align: justify;\">1) Nilai 91,00 &ndash; 100 &nbsp;(Unggul)</p><p style=\"text-align: justify;\">2) Nilai 80,00 &ndash; 90,99 &nbsp;(Sangat Baik)</p><p style=\"text-align: justify;\">3) Nilai 65,00 &ndash; 79,99 (Baik)</p><p style=\"text-align: justify;\">4) Nilai 50,00 &ndash; 64,99 &nbsp;(Cukup)</p><p style=\"text-align: justify;\">5) Nilai &lt; 50,00 (Kurang)</p><p style=\"text-align: justify;\">4. Saran/Tindak Lanjut:</p><p style=\"text-align: justify;\">Pada tahun 2023 Pemerintah Kabupaten Banjarnegara belum melakukan pengukuran IKK sehingga nilainya masih nol, dan disarankan dari LAN agar segera melakukan penilaian tahun 2024 dengan batas waktu paling lambat bulan Agustus 2024.&nbsp;Menunjuk Admin Instansi 1 (satu) orang dari Eselon 2 atau eselon 3 yang bekerja di bidang penyusunan kebijakan (Biro Hukum atau pusat kebijakan/perangkat daerah yang relevan) yang bertugas mengelola seluruh proses penilaian IKK. Menunjuk Enumerator dari eselon 3 atau eselon 4 atau Pejabat Fungsional atau Pelaksana yang bekerja di Bidang atau Unit Kerja Kebijakan yang akan dinilai. Untuk mendukung kelancaran pelaksanaan tugas pengukuran IKK dapat dibentuk Tim dengan Keputusan Bupati.&nbsp;Mengirimkan Lembar Konfirmasi Data Administrator IKK (konsep terlampir)</p></p>\n',NULL,'WhatsApp Image 2024-10-28 at 08.56.26.webp',529,'list','-','2024-10-28 01:58:21',1,'2024-07-11'),
(4,NULL,'Sosialisasi Peraturan Perundang-Undangan Kabupaten Banjarnegara Tahun 2024','Sosialisasi Peraturan Perundang-Undangan Kabupaten Banjarnegara Tahun 2024','sosialisasi-peraturan-perundang-undangan-kabupaten-banjarnegara-tahun-2024','<p style=\"text-align: justify;\">Banjarnegara &ndash; 24 September 2024, Bagian Hukum Setda Kabupaten Banjarnegara menyelenggarakan &ldquo;Sosialisasi Peraturan Perundang-Undangan Kabupaten Banjarnegara Tahun 2024&rdquo;, bertempat di Aula Sasana Bhakti Praja. Bagian Hukum mempunyai tugas melaksanakan penyiapan perumusan kebijakan daerah, pengoordinasian perumusan kebijakan daerah pengoordinasian pelaksanaan tugas Perangkat Daerah, pelaksanaan pemantauan dan evalusasi dibidang perundang-undangan, bantuan hukum serta dokumentasi dan informasi.<p style=\"text-align: justify;\">Kegiatan Sosialisasi Peraturan Perundang-Undangan dilaksanakandalam rangka menyebarluaskan Peraturan Daerah yang telah diundangkan dalam lembaran daerah dan Peraturan Kepala Daerah yang telah diundangkan dalam berita daerah. &nbsp;<img width=\"337\" height=\"253\" src=\"/berita/image_1727748675_0.webp\">&nbsp;</p><p style=\"text-align: justify;\">Pada kegiatan ini dilakukan sosialisasi peraturan perundang-undangan yang terdiri dari Peraturan Daerah Nomor 3 Tahun 2019 tentang Kawasan Tanpa Rokok dan Peraturan Bupati Nomor 43 Tahun 2023 tentang Jaringan dan Informasi Hukum dengan narasumber Haryono Widyastomo, S.H.M.H., selaku Koordinator Peraturan Perundang-Undangan Sekretariat Daerah Provinsi Jawa Tengah.</p></p>\n',NULL,'WhatsApp Image 2024-09-25 at 07.53.27.webp',111,'list','Tia','2024-10-01 02:11:15',1,'2024-09-24'),
(11,NULL,'Kunjungan JDIH BPK ke JDIH Kabupaten Banjarnegara','Kunjungan JDIH BPK ke JDIH Kabupaten Banjarnegara','kunjungan-jdih-bpk-ke-jdih-kabupaten-banjarnegara','<p style=\"text-align: justify;\"><strong>Banjarnegara, 24 Juni 2024 </strong>Tim JDIH (Jaringan Dokumentasi dan Informasi Hukum) BPK yang diwakili oleh Maharani Sekar Tunjung Sari dan Wardani Prawinandi berkesempatan melakukan kunjungan ke JDIH Kabupaten Banjarnegara. Kunjungan ini dalam rangka pendokumentasian Produk Hukum Daerah Kabupaten Banjarnegara yang merupakan salah satu sarana pengumpulan peraturan daerah UJDIH BPK Perwakilan Provinsi Jawa Tengah di Kabupaten Banjarnegara.&nbsp;<p style=\"text-align: justify;\">Adapun daftar permintaan Peraturan Daerah Kabupaten Banjarnegara terdiri dari Peraturan Daerah Kabupaten Banjarnegara dan Peraturan Bupati Banjarnegara mulai tahun 1951 sampai dengan yang terbaru tahun 2024.</p></p>\n',NULL,'WhatsApp Image 2024-10-28 at 09.28.20.webp',53,'list','-','2024-10-28 02:43:40',1,'2024-06-24'),
(13,NULL,'PENYAMAAN PERSEPSI PENYUSUNAN PRODUK HUKUM DAERAH KABUPATEN/KOTA, PEMPROV JATENG GELAR RAKOR DENGAN 35 KABUPATEN/KOTA','PENYAMAAN PERSEPSI PENYUSUNAN PRODUK HUKUM DAERAH KABUPATEN/KOTA, PEMPROV JATENG GELAR RAKOR DENGAN 35 KABUPATEN/KOTA','penyamaan-persepsi-penyusunan-produk-hukum-daerah-kabupaten/kota,-pemprov-jateng-gelar-rakor-dengan-35-kabupaten/kota','<p>Surakarta, 31 Agustus 2024 bertempat di Kantor Cabang Dinas Wilayah VII, Biro Hukum Provinsi Jawa Tengah menyelenggarakan kegiatan Rakor terkait Peningkatan Kemampuan Teknis dan Penyamaan Persepsi dalam Penyusunan Produk Hukum Daerah Kabupaten/Kota di Jawa Tengah. Dihadiri oleh 105 peserta dari unsur Bagian Hukum dan Sekretaris DPRD Kabupaten/Kota se Jateng. Rakor dibuka oleh Kepala Biro Hukum SETDA Provinsi Jawa Tengah, Iwanuddin Iskandar, S.H., M.Hum. Dalam sambutannya disampaikan bahwa Rapat Koordinasi Bidang Hukum menjadi penting dalam penyamaan persepsi penyusunan Produk Hukum Kabupaten/Kota sebagai upaya dalam peningkatan kapasitas teknis para penyusun peraturan perundang-undangan di Kabupaten/Kota.<p>Adapun narasumber pada kegiatan ini antara lain Saudara Edy Sujendro, S.H., M.H. Perancang Peraturan Perundang-Undangan Muda pada Kantor Wilayah Kementerian Hukum dan HAM Jawa Tengah dengan Materi Tata Cara Penyusunan Naskah Akademik. Saudara Hery Setyawan, S.H., M.H. Perancang Peraturan Perundang-Undangan Muda pada Kantor Wilayah Kementerian Hukum dan HAM Jawa Tengah dengan Materi Teknik Penyusunan Peraturan Perundang-Undangan, serta Saudara Dr. Zulkifli, M.M., CGAA dengan Materi Tata Cara Penyusunan Program Pembentukan Peraturan Daerah.</p><p>Dengan adanya Rapat Koordinasi dimaksud, diharapkan dapat menjadi acuan dalam penyusunan peraturan perundang-undangan dan menjadi perbaikan mulai dari proses perencanaan sampai dengan perundangan, sehingga penyusunan peraturan perundang-undangan di kabupaten/kota menjadi seragam dan tidak bertentangan dengan peraturan perundang-undangan di atasnya.</p></p>\n',NULL,'WhatsApp Image 2024-11-01 at 10.53.44_462feda6.webp',NULL,'list','Tia','2024-11-01 03:54:13',1,'2024-11-01'),
(14,NULL,'MONITORING KETERSEDIAAN DAN DISTRIBUSI LPG 3KG','MONITORING KETERSEDIAAN DAN DISTRIBUSI LPG 3KG','monitoring-ketersediaan-dan-distribusi-lpg-3kg','<p style=\"text-align: justify;\">Banjarnegara - 15 November 2024, Bagian Hukum Setda Kabupaten Banjarnegara yang tergabung dalam tim \"Pengawasan dan Distribusi LPG 3Kg Kabupaten Banjarnegara\" melaksanakan kegiatan monitoring dan evaluasi distribusi serta ketersediaan LPG 3 kg pada wilayah Kecamatan Purwareja Klampok dan Kecamatan Susukan. Kegiatan ini dipimpin Asisten Perekonomian dan Pembangunan Riatmojo Ponco Nugroho, S.E,M.E. serta tim yang tergabung dalam tim pengawasan.<p style=\"text-align: justify;\">Kegiatan monitoring LPG 3 Kg&nbsp; ini sendiri berupa proses pemantauan pendistribusian LPG 3 kg tepat sasaran mulai dari awal hingga akhir serta melakukan evaluasi terhadap hasil dan dinamika program tersebut baik positif maupun negatif dan mencegah terjadinya penimbunan dan penjualan yang tidak sesuai untuk peruntukannya. Saat ini Pertamina tengah melakukan pendataan pengguna LPG 3 kg, pembeli diminta untuk menunjukan KTP kepada pengecer yang kemudian dikirim ke pangkalan guna diregistrasi oleh Pertamina apakah yang bersangkutan berhak mengggunakan LPG 3 kg atau tidak. Untuk selanjutnya pembeli cukup menunjukan KTP miliknya yang terdata dalam sistem.&nbsp;</p><p style=\"text-align: justify;\">Adapun hasil monitoring tingkat agen dan pangkalan pada Kecamatan Purwareja Klampok dan Kecamatan Susukan bahwa stok aman dan pengiriman tetap dilaksanakan seperti biasa.</p><p>&nbsp;</p></p>\n',NULL,'IMG_5635.webp',109,'list','imam','2024-11-18 13:13:23',1,'2024-11-18'),
(15,NULL,'Konsultasi Pengelolaan JDIH Kabupaten Banjarnegara dan Pengisian E-Reporting Tahun 2024','Konsultasi Pengelolaan JDIH Kabupaten Banjarnegara dan Pengisian E-Reporting Tahun 2024','konsultasi-pengelolaan-jdih-kabupaten-banjarnegara-dan-pengisian-e-reporting-tahun-2024','<p style=\"text-align: justify;\">Semarang, 21 November 2024 Tim Bagian Hukum bersama dengan Sekretariat DPRD didampingi Dinas Kominfo dan Dinas Arpus Kabupaten Banjarnegara melakukan konsultasi terkait pengelolaan JDIH dan pengisian e-reporting JDIHN Tahun 2024. Tim diterima oleh Pengelola JDIH Provinsi Jawa Tengah beserta Pengelola JDIH Sekretariat DPRD Provinsi Jawa Tengah.<p style=\"text-align: justify;\">Pada kesempatan ini Tim Pengelola JDIH Kabupaten Banjarnegara menanyakan beberapa aspek mengenai indikator pengisian e-reporting seperti aspek organisasi meliputi dasar hukum dan SK Tim Pengelola JDIH, data dukung yang harus dilampirkan untuk pemenuhan aspek sumber daya manusia. Adapun pemenuhan data dukung koleksi dokumen, Tim JDIH Kabupaten Banjarnegara yang baru saja melakukan replikasi website diharapkan dapat memenuhi data dukung 5 tahun kebelakang untuk mendapatkan nilai maksimal serta dilengkapi abstrak di tahun berjalan. Sedangkan untuk indikator aspek pemenuhan pemanfaatan TIK yang mendapatkan nilai paling tinggi yakni pada pengelolaan website. JDIH Kabupaten Banjarnegara yang sudah melakukan replikasi website JDIH Provinsi Jawa Tengah dan masih dalam proses penyesuaian serta harus dilengkapi dengan sistem keamanan pentest.</p></p>\n',NULL,'WhatsApp Image 2024-11-22 at 07.52.16 (1).webp',84,'list','-','2024-11-22 05:55:45',1,'2024-11-21'),
(16,NULL,'Forum Investasi Daerah Kabupaten Banjarnegara','Forum Investasi Daerah Kabupaten Banjarnegara','forum-investasi-daerah-kabupaten-banjarnegara','<p style=\"text-align: justify;\">Banjarnegara, 25 November 2024 Sebagai sarana untuk menjalin sinergi melihat potensi dan peluang investasi antar perangkat daerah dan stakeholders. Kepala Bagian Hukum Setda Kabupaten Banjarnegara hadir pada forum investasi daerah Kabupaten Banjarnegara yang diselenggarakan oleh Dinas Tenaga Kerja, Penanaman Modal dan Pelayanan Terpadu Satu Pintu Kabupaten Banjarnegara.&nbsp;<p style=\"text-align: justify;\">Kegiatan ini bertujuan untuk membuka akses informasi seluas-luasnya mengenai potensi dan peluang investasi untuk meningkatkan daya saing ekonomi daerah dan penciptaan nilai tambah, serta mensinergikan kebijakan pembangunan perekonomian Kabupaten Banjarnegara diantara para pemangku kepentingan.</p></p>\n',NULL,'WhatsApp Image 2024-11-25 at 09.30.07.webp',152,'list','-','2024-11-25 06:38:42',1,'2024-11-25'),
(17,NULL,'Perkuat Pengelolaan JDIH, Bagian Hukum Kabupaten Banjarnegara Melakukan Studi Komparasi Pengelolaan JDIH Ke Kabupaten Purbalingga','Perkuat Pengelolaan JDIH, Bagian Hukum Kabupaten Banjarnegara Melakukan Studi Komparasi Pengelolaan JDIH Ke Kabupaten Purbalingga','perkuat-pengelolaan-jdih,-bagian-hukum-kabupaten-banjarnegara-melakukan-studi-komparasi-pengelolaan-jdih-ke-kabupaten-purbalingga','<p style=\"text-align: justify;\">Purbalingga, 30 Mei 2024 Sebagai sarana untuk menjalin komunikasi dan berbagi pengalaman antar anggota pengelola JDIH ditingkat Kabupaten dalam melakukan kegiatan pengelolaan JDIH, Bagian Hukum Setda Kabupaten Banjarnegara melakukan kegiatan studi komparasi ke Bagian Hukum Setda Kabupaten Purbalingga.<p style=\"text-align: justify;\"><img width=\"243\" height=\"324\" src=\"/berita/image_1732518141_0.webp\"></p><p style=\"text-align: justify;\">Hal-hal yang dibahas dalam kegiatan tersebut antara lain mengenai Pengelolaan Dokumen Langka di Kabupaten Purbalingga dilakukan dengan pendokumentasian melalui pengambilan gambar yang kemudian di unggah ke dalam website JDIH, pengelolaan produk hukum dan perpustakaan hukum.</p><p style=\"text-align: justify;\">Dengan adanya kegiatan ini diharapkan dapat menjaring masukan dan dapat menjadi sarana untuk melakukan inovasi untuk lebih mengembangkan pengelolaan JDIH kedepannya.</p><p style=\"text-align: justify;\">&nbsp;</p></p>\n',NULL,'WhatsApp Image 2024-11-25 at 13.59.17.webp',35,'list','-','2024-11-25 07:02:22',1,'2024-05-31'),
(18,NULL,'Bagian Hukum Setda Kabupaten Banjarnegara Hadir Dalam Pengintegrasian JDIHN (Validasi Dokumen Hukum JDIHN) Tahun 2024','Bagian Hukum Setda Kabupaten Banjarnegara Hadir Dalam Pengintegrasian JDIHN (Validasi Dokumen Hukum JDIHN) Tahun 2024','bagian-hukum-setda-kabupaten-banjarnegara-hadir-dalam-pengintegrasian-jdihn-(validasi-dokumen-hukum-jdihn)-tahun-2024','<p style=\"text-align: justify;\">Jakarta - Badan Pembinaan Hukum Nasional (BPHN) menyelenggarakan kegiatan Validasi Dokumen Hukum Jaringan Dokumentasi dan Informasi Hukum (JDIHN) Tahun 204, Selasa (20/02/2024). Bagian Hukum Kabupaten Banjarnegara dalam kegiatan ini turut serta sebagai peserta. &nbsp;<p style=\"text-align: justify;\">Kepala Pusat JDIHN BPHN, Nofli menyampaikan pengelolaan basis data dokumen hukum nasional masih menemukan beberapa permasalahan terkait kualitas data dokumen hukum yang terintegrasi pada portal JDIHN.GO.ID. \"Permasalahan terkait data dokumen hukum ini menyebabkan tidak seragamnya pengolahan dokumen hukum pada portal JDIHN.GO.ID,\" ucap Nofli pada kegiatan yang berlangsung di Aston Kartika Grogol, Jakarta.</p><p style=\"text-align: justify;\">Lebih lanjut, Nofli menjelaskan penataan basis data peraturan perundang-undangan merupakan salah satu variabel yang menjadi penilaian dalam Indeks Reformasi Hukum pada Kementerian/Lembaga dan Pemerintah Daerah. \"Para anggota JDIHN perlu mencermati pengelolaan JDIH sesuai dengan Peraturan Menteri Hukum dan HAM (Permenkumham) Nomor 8 Tahun 2019 tentang Standar Pengelolaan Dokumen dan Informasi Hukum, yang menjadi indikator variabel ke-4 penilaian Indeks Reformasi Hukum sebagaimana telah ditetapkan dalam Road Map Reformasi Birokrasi 2020-2024,\" jelas Nofli.</p><p style=\"text-align: justify;\">Saat ini, BPHN melalui Pusat JDIHN telah berhasil mengintegrasikan 1.233 website JDIH dan menjadi wadah sebanyak 571.976 dokumen hukum terintegrasi yang menjadi referensi utama dalam mengakses informasi hukum.</p><p style=\"text-align: justify;\">Kemudian Pranata Komputer Ahli Madya BPHN, Emalia Suwartika &nbsp;menyebut melalui kegiatan ini diharapkan dapat menjadi sarana peningkatan kompetensi &nbsp;sumber daya manusia pengelola laman JDIH anggota JDIHN. \"Peningkatan kompetensi sumber daya manusia ini diharapkan dapat mendorong pengelolaan JDIH yang sesuai standar pengelolaannya pada Permenkumham Nomor 8 Tahun 2019 tentang Standar Pengelolaan Dokumen dan Informasi Hukum,\" kata Emilia.</p><p style=\"text-align: justify;\">Para anggota JDIHN dalam kegiatan ini diberikan pendalaman terkait pengelolaan JDIH sesuai dengan Permenkumhan Nomor 8 Tahun 2019, informasi terkait penilaian JDIH di tahun 2024 yang mengalami perubahan dari 32 indikator menjadi 29 indikator penilaian, serta bimbingan teknis mengenai pengisian metadata dan pembuatan abstrak dokumen hukum.</p><p style=\"text-align: justify;\">Kegiatan ini diikuti oleh 170 anggota JDIHN yang terdiri dari Biro Hukum Kementerian, Lembaga Pemerintah Non Kementerian (LPNK), Lembaga Non Struktural (LNS), Biro Hukum Pemerintah Provinsi, Bagian Hukum Pemerintah Kabupaten/Kota, Bagian Hukum DPRD Provinsi/Kabupaten/Kota. Kegiatan ini diharapkan dapat memberikan peningkatakan kompetensi bagi anggota JDIH khususnya Kabupaten Banjarnegara dalam pengelolaan data dan dokumen hukum pada JDIH.</p></p>\n',NULL,'WhatsApp Image 2024-11-25 at 14.26.15.webp',38,'list','Tia','2024-11-25 07:26:58',1,'2024-02-22'),
(19,NULL,'Monitoring dan Evaluasi JDIH Kabupaten Banjarnegara oleh Biro Hukum Sekretariat Daerah Provinsi Jawa Tengah','Monitoring dan Evaluasi JDIH Kabupaten Banjarnegara oleh Biro Hukum Sekretariat Daerah Provinsi Jawa Tengah','monitoring-dan-evaluasi-jdih-kabupaten-banjarnegara-oleh-biro-hukum-sekretariat-daerah-provinsi-jawa-tengah','<p style=\"text-align: justify;\">Banjarnegara, 16 Mei 2024 Dalam rangka pembinaan, pengembangan, dan evaluasi pengelolaan Jaringan Dokumentasi dan Informasi Hukum, Biro Hukum Sekretariat Daerah (Setda) Provinsi Jawa Tengah selaku Pusat JDIH di Provinsi Jawa Tengah melaksanakan Monitoring dan Evaluasi Pengelolaan JDIH Banjarnegara Tahun 2023-2024.<p style=\"text-align: justify;\">Monitoring dan Evaluasi Pengelolaan JDIH dilaksanakan &nbsp;melalui:</p><p style=\"text-align: justify;\">1. Monitoring dan Evaluasi merupakan bahan penilaian pengolaan JDIH Provinsi Jawa Tengah Terbaik Tahun 2024;</p><p style=\"text-align: justify;\">2. Monitoring dan Evaluasi dilaksanakan terhadap pengelolaan JDIH dengan indikator sesuai &nbsp;ketentuan Peraturan Presiden Nomor 33 Tahun 2012 tentang Jaringan Dokumentasi dan Informasi Hukum Nasional.</p><p style=\"text-align: justify;\"><img width=\"378\" height=\"284\" src=\"/berita/image_1732520520_0.webp\"></p><p style=\"text-align: justify;\">Tim JDIH Kabupaten Banjarnegara yang terdiri dari Bagian Hukum Setda Kabupaten Banjarnegara, Dinas Komunikasi dan Informasi Kabupaten Banjarnegara, Dinas Arpusda Kabupaten Banjarnegara dalam kesempatan ini memaparkan mengenai pengelolaan JDIH Kabupaten Banjarnegara pada tahun 2023-2024, mulai dari Dasar Hukum Jdih Kabupaten Banjarnegara, Sumber Daya Manusia JDIH Kabupaten Banjarnegara , Koleksi Dokumen Hukum, Teknis Pengelolaan, Pemanfaatan Teknologi Informasi dan Komunikasi, serta Inovasi Pengelolaan JDIH Kabupaten Banjarnegara.</p><p style=\"text-align: justify;\">Selanjutnya dari hasil monitoring dan evaluasi oleh Biro Hukum Setda Provinsi Jawa Tengah dapat diketahui aspek-aspek yang masih perlu dilengkapi, dan Tim JDIH Kabupaten Banjarnegara akan menindaklanjuti dengan melengkapi kekurangan yang dimaksud.</p></p>\n',NULL,'WhatsApp Image 2024-11-25 at 14.39.55 (1).webp',38,'list','Tia','2024-11-25 07:42:00',1,'2024-05-16'),
(20,NULL,'Kunjungan Studi Penyusunan Rancangan Peraturan Daerah Kabupaten Ogan Komering Ulu Sumatera Selatan','Kunjungan Studi Penyusunan Rancangan Peraturan Daerah Kabupaten Ogan Komering Ulu Sumatera Selatan','kunjungan-studi-penyusunan-rancangan-peraturan-daerah-kabupaten-ogan-komering-ulu-sumatera-selatan','<p style=\"text-align: justify;\">Banjarnegara, 17 Mei 2024 Pemerintah Daerah Kabupaten Ogan Komering Ulu (OKU), Provinsi Sumatera Selatan melaksanakan Studi Komparasi ke Pemerintah Daerah Kabupaten Banjarnegara terkait Penyusunan Rancangan Peraturan Daerah Tahun 2024 Kabupaten OKU.<p style=\"text-align: justify;\"><img width=\"320\" height=\"426\" src=\"/berita/image_1732524326_0.webp\"></p><p style=\"text-align: justify;\">Perwakilan Pemerintah Daerah Kabupaten OKU terdiri dari Bagian Hukum Sekretariat Daerah (Setda) Kabupaten OKU, Bagian Organisasi Kabupaten OKU, serta Badan Perencanaan Pembangunan Daerah dan Penelitian Pengembangan Kabupaten OKU. Terdapat 11 (sebelas) Rancangan Peraturan Daerah (Raperda) Kabupaten OKU yang akan disusun di tahun 2024, antara lain Raperda tentang Penyertaan Modal Perusahaan Umum Daerah Air Minum Tirta Raja, Perubahan atas Peraturan Daerah Nomor 1 Tahun 2021 tentang Perubahan Bentuk Badan Hukum PT.BPR Baturaja Kabupaten OKU menjadi PT.BPR Baturaja, Revisi Rencana Tata Ruang Wilayah Kabupaten OKU Tahun 2012-2032, Rencana Pembangunan Jangka Panjang Daerah Tahun 2025-2045, Perlindungan dan Pelayanan Kesejahteraan Sosial Bagi Penyandang Disabilitas, Perubahan Ketiga atas Perda Nomor 9 Tahun 2016 tentang Pembentukan dan Susunan Perangkat Kerja Daerah Kabupaten OKU, Pencegahan dan Peningkatan Kualitas terhadap Perumahan Kumuh dan Pemukiman Kumuh, Pedoman Pemberian Nama Jalan dan Sarana Umum, Penyertaan Modal Pemerintah Kabupaten OKU ke Bank Sumsel, Literasi Minat Baca, Penyelenggaraan Pesantren.</p></p>\n',NULL,'WhatsApp Image 2024-11-25 at 15.43.10.webp',37,'list','Tia','2024-11-25 08:45:26',1,'2024-05-17'),
(21,NULL,'Bagian Hukum Gelar Sosialisasi Cegah Korupsi dan Gratifikasi untuk OPD dan BUMD','Bagian Hukum Gelar Sosialisasi Cegah Korupsi dan Gratifikasi untuk OPD dan BUMD','bagian-hukum-gelar-sosialisasi-cegah-korupsi-dan-gratifikasi-untuk-opd-dan-bumd','<p style=\"text-align: justify;\"><strong>Banjarnegara, 4 Desember 2024</strong> Tim Penerangan Hukum Kejaksaan Tinggi (Kejati) Jawa Tengah memberikan sosialisasi Penerangan Hukum untuk OPD dan BUMD se-Kabupaten Banjarnegara.&nbsp;Kegiatan yang digelar di aula Sasana Bhakti Praja Setda Kabupaten Banjarnegara ini bermuara pada pencegahan potensi praktik Tindak Pidana Korupsi.<p style=\"text-align: justify;\">Pencegahan itu bagian dari upaya prefentif dalam memberikan kemanfaatan hukum kepada masyarakat dalam rangka melaksanakan kegiatan Penerangan Hukum Program Pembinaan Masyarakat Taat Hukum Tahun 2024.</p><p style=\"text-align: justify;\">Sebagai narasumber dari Kejati Jateng yaitu Arfan Triono, S.H. Kepala Seksi Penerangan Hukum Kejaksaan Tinggi Jawa Tengah menyampaikan materi tentang celah korupsi pada pengadaan barang dan jasa dan Pardiono, S.H. Jaksa Fungsional Kejaksaan Tinggi Jawa Tengah dengan materi kiat-kiat menangani proyek agar terhindar dari Perbuatan Melawan Hukum Korupsi.</p><p style=\"text-align: justify;\">Harapannya agar Perangkat Daerah dan BUMD di Kabupaten Banjarnegara taat dan patuh pada hukum yang berlaku.</p></p>\n',NULL,'WhatsApp Image 2024-12-09 at 11.02.18.webp',57,'list','Tia','2024-12-09 06:40:15',1,'2024-12-04'),
(22,NULL,'Peringatan Hari Anti Korupsi Sedunia','Peringatan Hari Anti Korupsi Sedunia','peringatan-hari-anti-korupsi-sedunia','<p style=\"text-align: justify;\">Banjarnegara 9 Desember 2024 bertempat pada aula Sasana Bhakti Praja lantai I Sekretariat Daerah Kabupaten Banjarnegara dilaksanakan kegiatan peringatan Hari Anti Korupsi Sedunia (Harkodia) yang dihadiri oleh Organisasi Perangkat Daerah (OPD) se Kabupaten Banjarnegara. Sejarah Hari Anti Korupsi Sedunia (Harkordia) yang diperingati pada 9 Desember ini dilatarbelakangi oleh munculnya kesadaran untuk mengakhiri dampak buruk korupsi dan untuk menumbuhkan kesadaran publik terkait budaya laten korupsi. Peringatan Harkordia yang ditetapkan oleh Perserikatan Bangsa-Bangsa (PBB) telah menyatukan pandangan negara-negara bahwa korupsi merupakan musuh bersama karena dampak buruk yang ditimbulkannya dan merupakan bentuk komitmen dunia dalam melawan korupsi, serta untuk meningkatkan kesadaran dan peran Konvensi dalam memberantas dan mencegahnya. PBB menyoroti pentingnya hubungan antikorupsi dan perdamaian, keamnanan dan pembangunan. Pemerintah, sektor swasta,&nbsp; organisasi non-pemerintah, media dan warga negara diseluruh dunia bergabung untuk memerangi kejahatan tindakan korupsi. Melalui Harkordia negara-negara ingin menunjukan peran dan tanggung jawabnya dalam upaya pemberantasan korupsi yang telah menjadi kejahatan luar biasa sekaligus untuk memperluas keterlibatan masyarakat dalam mengimplementasikan nilai dan pemberantasan korupsi. Indonesia sebagai salah satu negara yang meratifikasi dan menyetujui Konvensi PBB anti korupsi (UNCAC), berperan aktif dalam memperingati Hari Anti Korupsi Sedunia setiap tahun.<p style=\"text-align: justify;\">Perayaan yang diinisiasi oleh PBB ini dilakukan untuk menumbukan kesadaran setiap orang betapa buruknya dampak yang ditimbulkan dari praktik korupsi dan bertujuan menigkatkan kesadaran masyarakat serta peran konvensi dalam memerangi dan mencegahnya. Upaya penanggulangan kejahatan luar biasa ini meruapak hak dan tanggung jawab semua orang. PBB menekankan diperlukan kerja sama dan kesadaran dari semua aktor mulai dari negara, pejabat pemerintah, pegawai negeri, aparat penegak hukum, masyarakat sipil, akademisi, sektor swasta hingga media untuk melawan korupsi.&nbsp;</p><p style=\"text-align: justify;\">Pada peringatan Hari Anti Korupsi Sedunia (Harkodia) hari ini juga dilaksankan kegiatan penyuluhan penyuluhan hukum dengan tema \"Stop Korupsi Hasil Korupsi Sanes Rejeki\" oleh Kejaksaan Negeri Kabupaten Banjarnegara dengan pemateri Kasi Intel Kejari Banjarnegara Taufik Hidayat, S.H.,M.H Kasi pidsus Kejari Banjarnegara Sutan Takdir,S.H. serta Kasubbag Pembinaan Slamet Indra Wijaya, S.H.,M.H.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p></p>\n',NULL,'IMG_5857.webp',76,'list','Imam','2024-12-09 07:35:38',1,'2024-12-09'),
(23,NULL,'Desk E-Reporting JDIH Tahun 2024 oleh Biro Hukum SETDA Provinsi Jawa Tengah','Desk E-Reporting JDIH Tahun 2024 oleh Biro Hukum SETDA Provinsi Jawa Tengah','desk-e-reporting-jdih-tahun-2024-oleh-biro-hukum-setda-provinsi-jawa-tengah','<p style=\"text-align: justify;\"><strong>Banyumas, 5 Desember 2024&nbsp;</strong>Biro Hukum SETDA Provinsi Jawa Tengah menyelenggarakan Desk Pendampingan Pelaporan Pengelolaan JDIH Tahun 2024 Anggota JDIH Provinsi Jawa Tengah untuk Wilayah Eks Karisidenan Banyumas dan Eks Karisidenan Pekalongan yang bertempat di Aula Bapeddalitbang Kabupaten Banyumas. Kegiatan ini dibuka oleh Pj. Bupati Banyumas (Bapak Iwanuddin Iskandar, S.H., M.Hum). Dalam sambutannya Anggota JDIH Provinsi Jawa Tengah agar terus menerus dapat melayani masyarakat sehingga meningkatkan kualitas pelayanan publik secara optimal.<p style=\"text-align: justify;\">Dengan diselenggarakan kegiatan Desk E-Reporting ini, untuk mengukur kesiapan pengelolaan JDIH Kabupaten Banjarnegara dalam pemenuhan kewajiban pelaporan kinerja pengelolaan JDIH dan pemenuhan data dukung yang kurang atau keliru agar dapat segera dipenuhi dan pelaporan dilakukan tidak melebihi batas waktu yang ditentukan oleh Pusat JDIH Nasional pada tanggal 31 Desember 2024.</p><p style=\"text-align: justify;\">Biro Hukum SETDA Provinsi Jawa Tengah melaksanakan Desk E-Reporting terkait beberapa indikator penilaian yang diantaranya aspek organisasi, aspek sdm, aspek koleksi dokumen hukum, aspek teknis pengelolaan, aspek sarana prasarana, aspek tik, dan pengembangan JDIH.</p><p style=\"text-align: justify;\">Laporan Pengelolaan JDIH oleh Anggota JDIH (e-reporting) ini dilakukan sebagai dasar pemeringkatan dan pemberian penghargaan Anggota JDIH Nasional Terbaik oleh Menteri Hukum RI. Serta menjadi salah satu aspek penilaian Indeks Reformasi Hukum dengan bobot 20%.</p></p>\n',NULL,'WhatsApp Image 2024-12-09 at 14.26.02.webp',72,'list','Tia','2024-12-09 07:55:17',1,'2024-12-06'),
(24,NULL,'UPAH MINIMUM KABUPATEN KOTA PROVINSI JAWA TENGAN TAHUN 2025','UPAH MINIMUM KABUPATEN KOTA PROVINSI JAWA TENGAN TAHUN 2025','upah-minimum-kabupaten-kota-provinsi-jawa-tengan-tahun-2025','<p style=\"text-align: justify;\"><strong>PENJABAT </strong>(Pj) Gubernur Jawa Tengah Nana Sudjana Resmi Mengumumkan<strong> </strong>Upah Minimum Kabupaten/Kota, Rabu (18/12/2024). Besaran UMK dituangkan dalam Surat Keputusan Gubernur Jawa Tengah Nomor 561/45 Tahun 2024 tanggal 18 Desember 2024 dan berlaku mulai 1 Januari 2025.<p style=\"text-align: justify;\">Dalam surat keputusan tersebut UMK Kabupaten Banjarnegara Sebesar Rp. 2.170.475 sementera untuk UMK tertinggi di Provinsi Jawa Tengah adalah Kota Semarang. Penetapan kenaikan UMK 2025 ini dilakukan berdasarkan Peraturan Menteri Ketenagakerjaan Nomor 16 Tahun 2024 Tentang Penetapan Upah Minimum Tahun 2025. Adapun kenaikan UMK 2025 di 35 Kabupaten/Kota di Jawa Tengah masing-masing sebesar 6,5 persen dengan rata-rata kenaikan sebesar Rp. 148.742.</p><p style=\"text-align: justify;\"><a title=\"Lampiran UMK\" href=\"https://drive.google.com/file/d/175NjOXJuLhLK5JC_zTgNe-gGeE833EyT/view?usp=sharing\">Lampiran UMK</a></p><p style=\"text-align: justify;\">&nbsp;&nbsp;</p><p style=\"text-align: justify;\"><strong>&nbsp;</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p></p>\n',NULL,'download.webp',7010,'list','Imam','2024-12-19 04:39:46',1,'2024-12-19'),
(25,NULL,'DESK RENJA PERANGKAT DAERAH KABUPATEN BANJARNEGARA TAHUN 2026','DESK RENJA PERANGKAT DAERAH KABUPATEN BANJARNEGARA TAHUN 2026','desk-renja-perangkat-daerah-kabupaten-banjarnegara-tahun-2026','<p style=\"text-align: justify;\">Banjarnegara, 23 Januari 2025. Bagian Hukum Setda Kabupaten Banjarnegara hadir pada kegiatan Desk Renja Perangkat Daerah Kabupaten Banjarnegara Tahun 2026 yang bertempat di Aula Pangripta Bhakti, Badan Perencanaan Penelitian dan Pengembangan.<p style=\"text-align: justify;\">Menindaklanjuti Surat Edaran Bupati Nomor 000.7.2.4/43/BUPATI/2024 tanggal 23 Desember 2024 tentang Arah Kebijakan dan Prioritas Pembangunan, serta Pedoman Penyelenggaraan Masa Musyawarah Perencanaan Pembangunan Rencana Kerja Pemerintah Daerah Tahun 2026.</p><p style=\"text-align: justify;\"><img width=\"450\" height=\"337\" src=\"/berita/image_1737618083_0.webp\"></p><p style=\"text-align: justify;\">Bagian Hukum&nbsp;menyampaikan capaian indikator Tahun 2024 serta menyampaikan Rancangan Awal Renja Perangkat Daerah Tahun 2026 untuk sub Fasilitasi Penyusunan Produk Hukum Daerah, Fasilitasi Bantuan Hukum dan Pendokumentasian Produk Hukum dan Pengelolaan Informasi Hukum.</p><p style=\"text-align: justify;\">Secara keseluruhan capaian indikator per aspek Bagian Hukum telah mencapai target di tahun 2024.</p></p>\n',NULL,'WhatsApp Image 2025-01-23 at 10.35.22 (1).webp',71,'list','-','2025-01-23 07:41:24',1,'2025-01-23'),
(26,NULL,'Kunjungan Tim Monev JDIH Provinsi Jawa Tengah dan Setwan Provinsi Jawa Tengah Terkait Pembinaan, Monitoring dan Evaluasi Jaringan Dokumentasi dan Infomasi Hukum Kabupaten Banjarnegara Tahun 2024','Kunjungan Tim Monev JDIH Provinsi Jawa Tengah dan Setwan Provinsi Jawa Tengah Terkait Pembinaan, Monitoring dan Evaluasi Jaringan Dokumentasi dan Infomasi Hukum Kabupaten Banjarnegara Tahun 2024','kunjungan-tim-monev-jdih-provinsi-jawa-tengah-dan-setwan-provinsi-jawa-tengah-terkait-pembinaan,-monitoring-dan-evaluasi-jaringan-dokumentasi-dan-infomasi-hukum-kabupaten-banjarnegara-tahun-2024','<p style=\"text-align: justify;\">Senin 24 Februari, Bagian Hukum Setda Kabupaten Banjarnegara menerima tim monitoring dan evaluasi pengelolaan jaringan dokumentasi dan informasi hukum Provinsi Jawa Tengah. Bertempat di perpustakaan JDIH Kabupaten Banjarnegara, kegiatan monitoring dan evaluasi dilaksanakan pukul 11.30-13.00 adapun maksud dari kegiatan ini adalah monitoring dan evaluasi kinerja pengelolaan JDIH Kabupaten Banjarnegara pada Tahun 2024.<p style=\"text-align: justify;\">Monitoring dan evaluasi dilaksanakan oleh Biro Hukum Provinsi Jawa Tengah yang sudah dimulai pada awal Februari 2025. Sesuai ketentuan Peraturan Presiden Nomor 32 Tahun 2012 tentang Jaringan Dokumentasi dan Informasi Hukum juncto Peraturan Daerah Provinsi Jawa Tengah Nomor 8 Tahun 2023 tentang Tata Cara Pembentukan Produk Hukum Daerah, bahwa Biro Hukum Provinsi Jawa Tengah merupakan pusat JDIH di wilayahan Provinsi Jawa Tengah.</p><p style=\"text-align: justify;\">Dalam rangka memberikan apresiasi kepada anggota JDIH di wilayah Jawa Tengah yang telah melaksanakan tugas dan fungsi pengelolaan JDIH serta sebagai upaya meningkatkan Indeks Reformasi Hukum pada Pemerintah Daerah perlu melakukan penilaian pengelolaan Jaringan Dokumentasi dan Informasi Hukum (JDIH) terhadap anggota JDIH Provinsi Jawa Tengah.</p></p>\n',NULL,'IMG_6130.webp',95,'list','Imam','2025-02-24 08:51:38',1,'2025-02-24'),
(27,NULL,'Desa Sijenggung Kembangkan JDIH, Wujudkan Akses Informasi Hukum yang Mudah dan Terbuka','Desa Sijenggung Kembangkan JDIH, Wujudkan Akses Informasi Hukum yang Mudah dan Terbuka','desa-sijenggung-kembangkan-jdih,-wujudkan-akses-informasi-hukum-yang-mudah-dan-terbuka','<p style=\"text-align: justify;\">Bagian Hukum mengembangkan pengelolaan JDIH sampai dengan tingkat desa/kelurahan. Kegiatan pengembangan pengelolaan JDIH tingkat desa/kelurahan dilakukan sebagai tindak lanjut dari amanat Peraturan Bupati Banjarnegara Nomor 43 Tahun 2023, serta mendukung keterbukaan informasi publik di wilayah pedesaan.<p style=\"text-align: justify;\">Kepala Desa Sijenggung menyambut baik dengan adanya pengembangan pengelolaan JDIH sampai ke desa. Sebagai langkah awal, Pemerintah Desa Sijenggung telah menyusun dan mengunggah berbagai dokumen hukum seperti Peraturan Desa, Peraturan Kepala Desa, dan Keputusan Desa ke dalam sistem informasi JDIH. Selain itu, akan dilakukan pula pelatihan teknis bagi perangkat desa dalam pengelolaan dan pembaruan konten JDIH secara berkala.</p><p style=\"text-align: justify;\">Dengan hadirnya JDIH di Desa Sijenggung, diharapkan menjadi langkah awal menuju tata kelola desa yang akuntebel, partisipatif, dan berbasis teknologi.</p></p>\n',NULL,'WhatsApp Image 2025-03-20 at 11.43.15.webp',62,'list','Tia','2025-04-22 01:32:38',1,'2025-03-20'),
(28,NULL,'Penyampaian Laporan Keterangan Pertanggungjawaban (LKPJ) Tahun 2024 Bersama dengan Komisi I','Penyampaian Laporan Keterangan Pertanggungjawaban (LKPJ) Tahun 2024 Bersama dengan Komisi I','penyampaian-laporan-keterangan-pertanggungjawaban-(lkpj)-tahun-2024-bersama-dengan-komisi-i','<p style=\"text-align: justify;\">Bagian Hukum Sekretariat Daerah Kabupaten Banjarnegara menghadiri rapat penyampaian Laporan Keterangan Pertanggungjawaban (LKPJ) Bupati Banjarnegara Tahun Anggaran 2024.<p style=\"text-align: justify;\">Bersama dengan Komisi I DPRD Kabupaten Banjarnegara membahas LKPJ selama tahun anggaran 2024, Bagian Hukum Sekretariat Daerah Kabupaten Banjarnegara telah melaksanakan kegiatan Fasilitasi dan Koordinasi Hukum yang didukung oleh 3 (tiga) sub kegiatan, yaitu Penyusunan dan Fasilitasi Produk Hukum Daerah, Pembinaan dan Pendampingan Hukum, serta Pengelolaan JDIH Kabupaten Banjarnegara.</p><p style=\"text-align: justify;\">Sub Kegiatan Fasilitasi Penyusunan Produk Hukum Daerah, jumlah rancangan produk hukum daerah yang ditetapkan dengan target keluaran 500 (lima ratus) dokumen realisasi 533 (lima ratus tiga puluh tiga) dokumen, sehingga capaian kinerja sebesar 106,60 %.</p><p style=\"text-align: justify;\">Sub Kegiatan Pembinaan dan Pendampingan Hukum, jumlah kasus yang mendapatkan fasilitasi bantuan hukum, dengan target 31 (tiga puluh satu) kasus terealisasi 31 (tiga puluh satu) kasus, sehingga mempunyai capaian kinerja sebesar 100%.</p><p style=\"text-align: justify;\">Sub Kegiatan Pendokumentasian Produk Hukum dan Pengelolaan Informasi Hukum, jumlah produk hukum dan pengelolaan infromasi hukum yang didokumentasikan, dengan target 220 (dua ratus dua puluh) dokumen terealisasi 200 (dua ratus) dokumen, sehingga capaiannya 90,91 %.</p><p style=\"text-align: justify;\">Hasil dari rangkaian penyampaian LKPJ Tahun 2024 akan disusun dalam bentuk rekomendasi DPRD, yang selanjutnya akan disampaikan dalam raoat paripurna.</p></p>\n',NULL,'WhatsApp Image 2025-04-17 at 15.08.41.webp',79,'list','Tia','2025-04-22 03:15:34',1,'2025-04-15'),
(29,NULL,'Pengharmonisasian Rancangan Peraturan Daerah Kabupaten Banjarnegara','Pengharmonisasian Rancangan Peraturan Daerah Kabupaten Banjarnegara','pengharmonisasian-rancangan-peraturan-daerah-kabupaten-banjarnegara','<p style=\"text-align: justify;\">Kamis, 17 April 2024 - Bagian Hukum Sekretariat Daerah Kabupaten Banjarnegara menghadiri Rapat Pengharmonisasian, Pembulatan, dan Pemantapan Konsepsi Rancangan Peraturan Daerah Kabupaten Banjarnegara tentang:<ol>\r\n<li>Perubahan Bentuk Badan Hukum Perusahaan Daerah Pertambangan Kabupaten Banjarnegara Menjadi Perusahaan Perseroan Daerah Pertambangan Kabupaten Banjarnegara;dan</li>\r\n<li>Perubahan Atas Peraturan Daerah Kabupaten Banjarnegara Nomor 20 Tahun 2017 tentang Pedoman Pengelolaan Barang Milik Daerah.</li>\r\n</ol><p>Rapat ini dihadiri oleh Kemenkum Kanwil Jawa Tengah, Bagian Hukum Setda Kabupaten Banjarnegara, dan instansi terkait lainnya.</p></p>\n',NULL,'WhatsApp Image 2025-04-17 at 14.45.03.webp',68,'list','Tia','2025-04-23 02:54:20',1,'2025-04-17'),
(30,NULL,'Pemkab Banjarnegara - BPOM Banyumas Tekan Nota Kesepakatan Sinergi Penyelenggaraan Pelayanan Publik Pada Mall Pelayanan Publik Kabupaten Banjarnegara','Pemkab Banjarnegara - BPOM Banyumas Tekan Nota Kesepakatan Sinergi Penyelenggaraan Pelayanan Publik Pada Mall Pelayanan Publik Kabupaten Banjarnegara','pemkab-banjarnegara---bpom-banyumas-tekan-nota-kesepakatan-sinergi-penyelenggaraan-pelayanan-publik-pada-mall-pelayanan-publik-kabupaten-banjarnegara','<p style=\"text-align: justify;\">Banjarnegara 5 Mei 2024 bertempat pada aula Mall Pelayanan Publik Banjarnegara Pemkab Banjarnegara - BPOM Banyumas menyepakati sinergi tentang pelayanan publik pada mall pelayanan publik Kabupaten Banjarnegara, penandatangan nota kesepakatan dilakukan oleh Bupati Banjarnegara yang dalam hal ini diwakili oleh Sekda Kabupaten Banjarnegara Drs. Indarto, M.Si.sementara dari pihak BPOM hadir kepala BPOM Banyumas Gidion,S.Si.,M.S.C. Adapun tujuan dari nota kesepakatan ini adalah untuk mewujudkan sinergi dalam upaya meningkatkan kecepatan, kemudahan, jangkauan, kenyamanan, dan keamanan pelayanan publik bagi masyarakat di Kabupaten Banjarnegara.<p style=\"text-align: justify;\">Ruang lingkup dari Nota Kesepakatan ini meliputi&nbsp;Pelayanan administrasi pengawasan obat dan makanan pada Balai Pengawas Obat dan Makanan yang meliputi sertifikasi CDOB (Cara Distribusi Obat yang baik), sertifikasi CPKB (Cara Pembuatan Kosmetik yang Baik), Sertifikasi CTOB (Cara Pembuatan Obat Tradisional yang Baik), Penerbitan IP CPPOB (Izin Penerapan cara Produksi Pangan Olahan yang Baik), Penerbitan Rekomendasi sebagai pemohon notifikasi kosmetik.</p><p style=\"text-align: justify;\">Waktu pelayanan administrasi pengawasan obat dan makanan oleh BPOM di Mal Pelayanan Publik (MPP) Kabupaten Banjarnegara dilaksanakan setiap hari Senin-Jumat mulai pukul 08.00 s.d 15.00.&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p></p>\n',NULL,'WhatsApp Image 2025-05-05 at 12.33.03.webp',57,'list','Imam','2025-05-05 07:15:32',1,'2025-05-05'),
(31,NULL,'Mendorong Integrasi Dokumen Hukum Melalui Rakor JDIH Provinsi Jawa Tengah','Mendorong Integrasi Dokumen Hukum Melalui Rakor JDIH Provinsi Jawa Tengah','mendorong-integrasi-dokumen-hukum-melalui-rakor-jdih-provinsi-jawa-tengah','<p style=\"text-align: justify;\">Dalam rangka meningkatkan kualitas dan integritas pengelolaan Jaringan Dokumentasi dan Informasi Hukum (JDIH) di Jawa Tangah, Pemerintah Provinsi Jawa Tengah menyelenggarakan Rapat Koordinasi Pengelolaan Jaringan Dokumentasi dan Informasi Hukum Provinsi Jawa Tengah Tahun 2025 yang bertempat di Gedung Gradhika Bhakti Praja Kantor Gubernur Jawa Tengah. Rakor ini dibuka oleh Wakil Gubernur Jawa Tengah, dihadiri oleh Kepala Kantor Wilayah Kementerian Hukum Jawa Tengah, Asisten Pemerintahan dan Kesejahteraan Rakyat, Sekretaris DPRD Provinsi Jawa Tengah, dan diikuti oleh Tim Pengelola JDIH Provinsi Jawa Tengah, serta para Pengelola JDIH pada Bagian Hukum, Sekretariat DPRD, Perguruan Tinggi dan Pemerintah Desa se Jawa Tengah.<p style=\"text-align: justify;\">Bapak Wakil Gubernur Jawa Tengah, mendorong penguatan Jaringan Dokumentasi dan Informasi Hukum (JDIH) di tingkat Pemerintah Desa, guna meningkatkan transparansi dan efektivitas pengelolaan produk hukum di tingkat desa, serta memudahkan masyarakat mengakses informasi, tentang peraturan desa dan produk hukum lainnya.&nbsp;</p><p style=\"text-align: justify;\">Tujuan utama Rakor ini adalah mendorong integrasi dokumen hukum dari tingkat desa hingga perguruan tinggi ke dalam JDIH Nasional, guna meningkatkan transparansi dan efektivitas pengelolaan produk hukum di tingkat desa serta memudahkan masyarakat mengakses informasi hukum.</p><p style=\"text-align: justify;\">Dalam acara Rakor ini juga diserahkan Penghargaan di berbagai kategori kepada Pengelola JDIH Terbaik, Birosebagai bentuk apresiasi dan motivasi untuk meningkatkan kualitas layanan dokumentasi dan informasi hukum.</p></p>\n',NULL,'WhatsApp Image 2025-05-15 at 10.01.01.webp',56,'list','Tia','2025-05-19 03:05:34',1,'2025-05-16'),
(32,NULL,'Kesepakatan Bersama Dan Perjanjian Kerja Sama Antara Pemkab Banjarnegara Dengan Dua Rumah Sakit Dan Enam Klinik Swasta Di Wilayah Kabupaten Banjarnegara Tentang Pelayanan Administrasi Kependudukan','Kesepakatan Bersama Dan Perjanjian Kerja Sama Antara Pemkab Banjarnegara Dengan Dua Rumah Sakit Dan Enam Klinik Swasta Di Wilayah Kabupaten Banjarnegara Tentang Pelayanan Administrasi Kependudukan','kesepakatan-bersama-dan-perjanjian-kerja-sama-antara-pemkab-banjarnegara-dengan-dua-rumah-sakit-dan-enam-klinik-swasta-di-wilayah-kabupaten-banjarnegara-tentang-pelayanan-administrasi-kependudukan','<p style=\"text-align: justify;\">Banjarnegara, Kamis 22 Mei 2025 Bertempat Pada Ruang Rapat Sekda Sekretariat Daerah Kabupaten Banjarnegara telah dilaksanakan penandatanganan kesepakatan bersama dan perjanjian kerja sama antara Pemkab Banjarnegara dengan dua rumah sakit dan enam klinik swasta. Hadir dalam kesempatan penandatanganan kesepakatan bersama dan perjanjian kerja sama ini Asisten Pemerintahan dan Kesejahteraan Rakyat Anang Sutanto, S.STP,M.Si. Kepala Dinas Kependudukan dan Pencatatan Sipil Tien Sumarwati, S.Sos,M.M. dan Bagian Hukum Setda serta perwakilan dari dua rumah sakit swasta yaitu Rumah Sakit Islam Banjarnegara, Rumah Sakit Emanuel serta enam klinik swasta yaitu Klinik Utama PKU Muhamadiyah Merden, Klinik Pratama PKU Muhamadiyah Kalibening, Klinik Utama Hidayah Banjarnegara, Klinik Utama Rawat Inap Restu Bunda, Klinik Utama Anugerah Banjarnegara dan Klinik utama Rawat Inap Bunda.<p style=\"text-align: justify;\">Maksud dan tujuan dari kesepakatan bersama dan perjanjian kerja sama ini didasarkan asas saling membantu dan saling mendukung agar penyelenggaraan percepatan kepemilikan akta kelahiran, KIA dan KK bagi anak baru lahir yang merupakan penduduk Kabupaten Banjarnegara berjalan efektif, efisien dan akuntabel. Ruang lingkup nya meliputi fasilitasi pelayanan akta kelahiran, fasilitasi pelayanan KIA, fasilitasi pelayanan KK. Perjanjian kerja sama ini merupakan bentuk komitmen Pemerintah Daerah Kabupaten Banjarnegara dalam memberikan peningkatan pelayanan publik, peningkatan pelayanan masyarakat untuk kemudahan mendapatkan pelayanan yang maksimal dari pemerintah daerah.</p><p style=\"text-align: justify;\">&nbsp;</p><p style=\"text-align: justify;\">&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p></p>\n',NULL,'IMG_6394.webp',75,'list','Imam','2025-05-28 01:58:07',1,'2025-05-26'),
(35,NULL,'Pansus 5 (Lima) Raperda bersama dengan DPRD Kabupaten Banjarnegara','Pansus 5 (Lima) Raperda bersama dengan DPRD Kabupaten Banjarnegara','pansus-5-(lima)-raperda-bersama-dengan-dprd-kabupaten-banjarnegara','<p>Panitia Khusus (Pansus) DPRD Kabupaten Banjarnegara menggelar rapat pembahasan terhadap 5 (lima) Rancangan Peretaruan Daerah (Raperda), mulai hari Rabu hingga Jumat tanggal 18-20 Juni 2025.<p>Kelima Raperda tersebut terdiri atas empat usulan dari 4 (empat) usulan Pemerintah Daerah dan 1 (satu) usulan inisiatif DPRD.</p><p>4 (empat) Raperda usulan Pemerintah Daerah meliputi:</p><ol>\r\n<li>Raperda tentang Rencana Pembangunan Jangka Menengah Daerah (RPJMD) Kabupaten Banjarnegara Tahun 2025-2029</li>\r\n<li>Raperda tentang Pengelolaan Sampah Plastik menjadi Bahan Bakar Minyak</li>\r\n<li>Raperda tentang Perubahan Badan Hukum Perusahaan Daerah Pertambangan Kabupaten Banjarnegara</li>\r\n<li>Raperda tentang Perubahan atas Peraturan Daerah Nomor 10 Tahun 2017 tentang Pengelolaan Barang Milik Daerah</li>\r\n</ol><p>sementara itu, 1 (satu) Raperda inisiatif DPRD adalah Raperda tentang Cagar Budaya.</p></p>\n',NULL,'WhatsApp Image 2025-06-19 at 10.18.31.webp',48,'list','-','2025-07-14 07:33:27',1,'2025-06-20'),
(36,NULL,'Paparan Hasil ITSA BSSN, Uji Keamanan Website JDIH Banjarnegara','Paparan Hasil ITSA BSSN, Uji Keamanan Website JDIH Banjarnegara','paparan-hasil-itsa-bssn,-uji-keamanan-website-jdih-banjarnegara','<p>Bagian Hukum Sekretariat Daerah Kabupaten Banjarnegara bersama Dinkominfo Kabupaten Banjarnegara mengikuti Kegiatan Paparan Hasil ITSA (Infoemation Technology Security Assesment) yang diselenggarakan oleh Badan Siber dan Sandi Negara (BSSN) RI.<p>BSSN melakukan penetration testing dan vulnerability assessment untuk menemukan titik lemah seperti <em>SQL Injection, misconfiguration</em>, atau<em> brute&acirc;&#128;&#145;force</em>, yang dapat dimanfaatkan peretas. Hal ini dilakukan agar kerentanan tersebut bisa diperbaiki sebelum diserang pihak luar.</p><p>Salah satu tujuan testing adalah menjamin bahwa informasi tidak bocor (confidentiality), data tidak dirusak (integrity), dan sistem tetap berjalan saat diperlukan (availability). Proses ini penting untuk memastikan website atau sistem masih bisa diakses publik tanpa gangguan .</p><p>Dengan rangkaian pengujian tersebut, BSSN membantu Pemerintah Daerah Kabupaten Banjarnegara khususnya JDIH Kabupaten Banjarnegara agar mampu memitigasi risiko siber, memperkuat pertahanan sistem, dan menjaga kepercayaan publik terhadap layanan digital nasional.</p></p>\n',NULL,'WhatsApp Image 2025-07-14 at 14.40.43.webp',55,'list','Tia','2025-07-14 07:45:28',1,'2025-07-03'),
(37,NULL,'Pengembangan Kompetensi Perancang Peraturan Perundang-Undangan bersama dengan Japan International Cooperation Agency (JICA)','Pengembangan Kompetensi Perancang Peraturan Perundang-Undangan bersama dengan Japan International Cooperation Agency (JICA)','pengembangan-kompetensi-perancang-peraturan-perundang-undangan-bersama-dengan-japan-international-cooperation-agency-(jica)','<p>Jakarta, 15 Juli 2025 &mdash; Dalam upaya pembinaan Perancang Peraturan Perundang-Undangan, Direktorat Jenderal Peraturan Perundang-Undangan bekerja sama dengan <em>Japan International Cooperation Agency&nbsp;</em>(JICA) menggelar kegiatan Bimbingan Teknis (Bimtek) Perancang Perundang-undangan, yang dilaksanakan selama 3 (tiga) hari pada 13&ndash;17 Juli 2025 di Le Meridien Hotel Jakarta.&nbsp;<p><img width=\"249\" height=\"187\" src=\"/berita/image_1752649067_0.webp\"> Kegiatan ini diikuti oleh para pejabat fungsional perancang peraturan perundang-undangan Bagian Hukum Sekretariat Daerah Kabupaten Banjarnegara sebagai perwakilan dari perangkat daerah yang terlibat dalam penyusunan peraturan perundang-undangan. Bimtek menghadirkan narasumber dari Direktorat Jenderal Peraturan Perundang-undangan Kementerian Hukum Republik Indonesia.</p><p>Materi yang disampaikan meliputi sistem penyusunan peraturan perundang-undangan di Jepang <em>System of formation law and regulations in japan</em>, Harmonisasi Peraturan Perundang-Undangan, serta Pelatihan Penyusunan Tanggapan atas Rancangan Peraturan Perundang-Undangan dan Review.</p><p>Melalui kegiatan ini, diharapkan setiap peserta mampu menerapkan teknik penyusunan regulasi yang baik.</p></p>\n',NULL,'WhatsApp Image 2025-07-15 at 14.08.18.webp',92,'list','Tia','2025-07-16 06:57:47',1,'2025-07-16'),
(38,NULL,'Pembahasan Raperda Perubahan APBD Kabupaten Banjarnegara Tahun Anggaran 2025 bersama dengan Komisi I DPRD Kabupaten Banjarnegara','Pembahasan Raperda Perubahan APBD Kabupaten Banjarnegara Tahun Anggaran 2025 bersama dengan Komisi I DPRD Kabupaten Banjarnegara','pembahasan-raperda-perubahan-apbd-kabupaten-banjarnegara-tahun-anggaran-2025-bersama-dengan-komisi-i-dprd-kabupaten-banjarnegara','<p style=\"text-align: justify;\">Bagian Hukum Sekretariat Daerah (Setda) Kabupaten Banjarnegara mengikuti Rapat Pembahasan Rancangan Peraturan Daerah (Raperda) Perubahan APBD Kabupaten Banjarnegara Tahun Anggaran 2025 yang diselenggarakan oleh DPRD Kabupaten Banjarnegara.<p style=\"text-align: justify;\">Bertempat di Ruang Paripurna, bersama dengan Komisi I DPRD dilakukan pembahasan terkait penyesuaian rencana keuangan daerah dengan perkembangan dan kebutuhan aktual yang terjadi di lapangan. Dalam rapat ini dihadiri pula beberapa Organisasi Perangkat Daerah (OPD) seperti Badan Kepegawaian Daerah (BKD), Dindukcapil, Dispermades, Satpol PP, Kesbangpol, dan Bagian Organisasi Setda Kabupaten Banjarnegara, berbagai usulan penyesuaian anggaran dibahas secara mendalam, termasuk pengalihan alokasi belanja dan penambahan anggaran untuk program prioritas. DPRD menekankan pentingnya transparansi dan akuntabilitas dalam setiap perubahan anggaran yang dilakukan demi meningkatkan pelayanan publik dan pembangunan daerah secara merata.</p></p>\n',NULL,'WhatsApp Image 2025-07-17 at 08.13.56.webp',82,'list','Tia','2025-07-17 01:31:42',1,'2025-07-15'),
(39,NULL,'Evaluasi dan Persiapan Pelaksanaan Aksi HAM Pemerintah Daerah di Provinsi Jawa Tengah','Evaluasi dan Persiapan Pelaksanaan Aksi HAM Pemerintah Daerah di Provinsi Jawa Tengah','evaluasi-dan-persiapan-pelaksanaan-aksi-ham-pemerintah-daerah-di-provinsi-jawa-tengah','<p style=\"text-align: justify;\">Bagian Hukum Sekretariat Daerah (Setda) Kabupaten Banjarnegara menghadiri acara Rapat Evaluasi Pelaksanaan Aksi HAM periode B04 dan Persiapan Aksi HAM B08 Pemerintah Daerah Provinsi dan Kabupaten/Kota Se-Jawa Tengah tahun 2025 yang diselenggarakan oleh Kementerian Hak Asasi Manusia Kantor Wilayah Jawa Tengah.<p style=\"text-align: justify;\"><img width=\"295\" height=\"164\" src=\"/berita/image_1753257984_0.webp\"></p><p style=\"text-align: justify;\">Bertempat di Aula Kresna Basudewa, Kantor Wilayah Kementerian Hukum Jawa Tengah kegiatan ini menghadirkan narasumber yang berasal dari Direktorat Jenderal Pelayanan dan Kepatuhan HAM.&nbsp;</p><p style=\"text-align: justify;\">Penilaian Capaian Aksi HAM Tahun 2025 Pemerintah Daerah Provinsi Jawa Tengah untuk Kelompok Sasaran Perempuan dan Penyandang Disabilitas rata-rata capaian di penilaian B04 sebesar 100 poin.</p></p>\n',NULL,'WhatsApp Image 2025-07-23 at 13.18.45.webp',94,'list','Tia','2025-07-23 08:06:24',1,'2025-07-23'),
(41,NULL,'Bimbingan Teknis Digitalisasi Dan Publikasi Produk Hukum Desa Pada Kecamatan Pagentan','Bimbingan Teknis Digitalisasi Dan Publikasi Produk Hukum Desa Pada Kecamatan Pagentan','bimbingan-teknis-digitalisasi-dan-publikasi-produk-hukum-desa-pada-kecamatan-pagentan','<p style=\"text-align: justify;\">Pagentan 28 Agustus 2025, bertempat pada aula Kecamatan Pagentan Bagian Hukum Setda Kabupaten Banjarnegara menjadi narasumber dalam kegiatan bimbingan teknis digitalisasi dan publikasi produk hukum desa kegiatan yang prakarsai oleh Kasi Tata Pemerintahan Kecamatan Pagentan Iwan Widiyanto, S.E. dan dihadiri oleh perwakilan dari setiap desa yakni operator website desa dan Ketua Badan Permusyawaratan Desa (BPD).<p style=\"text-align: justify;\">Desa sebagai pemerintahan yang paling dekat dengan mayarakat memiliki berbagai produk hukum desa seperti Peraturan Desa (Perdes), Peraturan Kepala Desa (Perkades), Peraturan Bersama Kepala Desa hingga Keputusan Desa namun seringkali produk hukum desa tersebut hanya tersimpan dalam arsip kertas sulit diakses serta kurang diketahui oleh masyarakat luas. Tujuan dari digitalisasi produk hukum desa tersebut adalah memberikan pemahaman tentang pentingnya dokumentasi produk hukum secara digital, mendorong desa untuk aktif mempublikasikan produk hukum kepada masyarakat dan mewujudkan keterbukaan informasi publik di tingkat desa.</p><p style=\"text-align: justify;\">Kenapa digitalisasi produk hukum desa ini penting karena untuk memudahkan akses secara cepat tanpa harus datang ke kantor desa dan dokumen digital lebih aman dibandingkan kertas yang bisa rusak, hilang atau terbakar serta mengurangi biaya penggadaan, fotokopi dan penyimpanan arsip fisik.&nbsp;</p><p style=\"text-align: justify;\">Strategi digitalisasi dan publikasi produk hukum desa pada era teknologi informasi meliputi membangun wadah utama publikasi produk hukum yaitu membangun website desa/jdih desa, menggunakan media sosial untuk menyebarkan informasi produk hukum dengan bahasa sederhana, kolaborasi pada pemerintah kabupaten, meningkatkan kemampuan teknologi informasi perangkat desa dan standarisasi penyimpanan produk hukum desa dalam bentuk file PDF, diberi nomor dan metadata agar mudah dicari.</p><p style=\"text-align: justify;\">Kedepannya setelah desa mengunggah produk hukum desa pada website desa akan terintegrasi pada JDIH kabupaten sehingga cakupan lebih luas serta monitoring dan evaluasi secara berkelanjutan.</p><p>&nbsp;</p></p>\n',NULL,'eb4198fc-b82c-48a7-b60b-ac13c6ad382e.webp',60,'list','Imam','2025-08-29 01:44:14',1,'2025-08-29'),
(42,NULL,'Fasilitasi Sosialisasi Peraturan Perundang-undangan Tahun 2025, Dorong Pemahaman Hukum di Daerah','Fasilitasi Sosialisasi Peraturan Perundang-undangan Tahun 2025, Dorong Pemahaman Hukum di Daerah','fasilitasi-sosialisasi-peraturan-perundang-undangan-tahun-2025,-dorong-pemahaman-hukum-di-daerah','<p>Banjarnegara, 2025 &ndash; Pemerintah Kabupaten Banjarnegara melalui Bagian Hukum Sekretariat Daerah menyelenggarakan kegiatan Fasilitasi Sosialisasi Peraturan Perundang-undangan Tahun 2025 sebagai upaya meningkatkan pemahaman dan kepatuhan masyarakat terhadap ketentuan hukum yang berlaku.<p>Kegiatan yang digelar pada hari ini dihadiri oleh pemerintah desa. Dalam sambutannya, Kepala Bagian Hukum menyampaikan bahwa fasilitasi sosialisasi ini merupakan bentuk komitmen pemerintah daerah untuk memperkuat budaya taat hukum dan memastikan regulasi dapat dipahami secara menyeluruh.<img src=\"../../berita/image_1756432302_0.webp\" width=\"344\" height=\"458\"></p><p>&ldquo;Peraturan perundang-undangan bukan hanya menjadi pedoman bagi penyelenggara pemerintahan, tetapi juga menjadi acuan bagi masyarakat dalam menjalankan hak dan kewajibannya. Oleh karena itu, kegiatan sosialisasi seperti ini sangat penting agar regulasi tidak hanya berhenti di atas kertas, melainkan benar-benar dipahami dan diimplementasikan,&rdquo; ungkapnya.</p><p>Materi yang disampaikan dalam kegiatan ini meliputi penyebarluasan peraturan terbaru serta integrasi Jaringan Dokumentasi dan Informasi Hukum di tingkat desa. Selain itu, peserta juga diberikan ruang diskusi untuk menyampaikan pertanyaan maupun kendala yang dihadapi dalam penerapan aturan di lapangan.</p><p>Dengan adanya fasilitasi sosialisasi ini, diharapkan terbangun sinergi antara pemerintah daerah dan masyarakat dalam menciptakan tata kelola pemerintahan yang baik, transparan, dan sesuai dengan prinsip-prinsip hukum yang berlaku.</p><p>&nbsp;</p></p>\n',NULL,'0a72e248-5ec8-4fd9-a9a4-2a9936084a17.webp',110,'list','Tia','2025-08-29 01:51:42',1,'2025-08-28'),
(43,NULL,'Workshop Peningkatan Sinergi Dalam Pengelolaan Dokumentasi Peraturan Perundang-Undangan','Workshop Peningkatan Sinergi Dalam Pengelolaan Dokumentasi Peraturan Perundang-Undangan','workshop-peningkatan-sinergi-dalam-pengelolaan-dokumentasi-peraturan-perundang-undangan','<p style=\"text-align: justify;\">Magelang - Museum BPK hadir sebagai simpul penting dalam menghubungkan generasi masa kini dengan sejarah, nilai, dan peran Badan Pemeriksa Keuangan (BPK) Republik Indonesia. Lebih dari sekadar tempat menyimpan artefak atau dokumen bersejarah, museum yang berlokasi di Magelang, Jawa Tengah ini menjadi ruang hidup yang menyampaikan cerita, menanamkan nilai, serta menginspirasi masyarakat untuk memahami pentingnya integritas, akuntabilitas, dan transparansi dalam pengelolaan keuangan negara.<p style=\"text-align: justify;\">BPK RI Perwakilan Jawa Tengah menyelenggarakan kegiatan Workshop dengan tema Peningkatan Sinergi Dalam Pengelolaan Dokumentasi Peraturan Perundang-undangan untuk Mendukung Akuntabilitas Pengelolaan Keuangan Negara/Daerah. Workshop dilaksanakan pada hari Rabu tanggal 10 September 2025 bertempat di Komplek Museum BPK RI Jl. Pangeran Diponegoro No. 1 Kota Magelang, Jawa Tengah.</p><p style=\"text-align: justify;\">Workshop tersebut diikuti oleh Anggota JDIH Kabupaten/Kota di Provinsi Jawa Tengah dengan Narasumber Kepala Biro Hukum Provinsi Jawa Tengah dan Kepala Pusat LKBH BPK RI. Kegiatan dibuka oleh Kepala BPK RI Perwakilan Jawa Tengah, Ahmad Luthfi H. Rahmatullah. Pada kesempatan tersebut Ahmad Luthfi menyampaikan bahwa JDIH sebagai pilar informasi hukum yang menopang integritas, transparansi, dan keberlanjutan tata kelola keuangan Negara yang baik.</p><p>&nbsp;</p></p>\n',NULL,'FOTO BPK.webp',75,'list','Tia','2025-09-26 07:34:44',1,'2025-09-10'),
(44,NULL,'Studi Referensi JDIH Kabupaten Banjarnegara Ke Kota Surakarta','Studi Referensi JDIH Kabupaten Banjarnegara Ke Kota Surakarta','studi-referensi-jdih-kabupaten-banjarnegara-ke-kota-surakarta','<p>Banjarnegara, 16 Oktober 2025 &ndash; Dalam rangka meningkatkan kualitas pengelolaan dan pengembangan Jaringan Dokumentasi dan Informasi Hukum (JDIH), Bagian Hukum Sekretariat Daerah Kabupaten Banjarnegara melaksanakan kegiatan studi referensi JDIH ke Bagian Hukum Sekretariat Daerah Kota Surakarta.<p>Kegiatan ini bertujuan untuk memperdalam pengetahuan dan menambah wawasan terkait pengelolaan JDIH yang efektif, modern, serta sesuai dengan standar yang ditetapkan oleh Badan Pembinaan Hukum Nasional (BPHN). Dalam kegiatan tersebut, rombongan JDIH Banjarnegara diterima langsung oleh Kepala Bagian Hukum Sekretariat Daerah Kota Surakarta.</p><p>Beberapa hal yang menjadi fokus pembahasan meliputi:</p><p>&middot; Strategi pengelolaan konten dan pemutakhiran data produk hukum,</p><p>&middot; Peningkatan keamanan dan integrasi sistem JDIH,</p><p>&middot; Pengelolaan sumber daya manusia dan pembagian peran pengelola JDIH,</p><p>&middot; Pemanfaatan teknologi informasi dalam pengelolaan dokumentasi hukum.</p><p>Melalui kegiatan ini, diharapkan pengelola JDIH Banjarnegara dapat mengimplementasikan praktik terbaik (best practices) yang diperoleh, guna meningkatkan pelayanan informasi hukum kepada masyarakat. Kegiatan studi referensi ini sangat bermanfaat untuk memperkuat pengelolaan JDIH di Banjarnegara, terutama dalam aspek digitalisasi dan tata kelola data hukum.</p><p>Kegiatan diakhiri dengan sesi tanya jawab, pertukaran cenderamata, serta komitmen untuk menjalin kerja sama dan komunikasi berkelanjutan antar pengelola JDIH di berbagai daerah.</p></p>\n',NULL,'WhatsApp Image 2025-11-04 at 13.42.01.webp',48,'list','Tia','2025-11-04 07:11:45',1,'2025-10-16'),
(46,NULL,'Sharing Session Dengan JDIH Bagian Hukum Sukoharjo','Sharing Session Dengan JDIH Bagian Hukum Sukoharjo','sharing-session-dengan-jdih-bagian-hukum-sukoharjo','<p style=\"text-align: justify;\">Sukoharjo - 17 Oktober 2025 JDIH Bagian Hukum Banjarnegara Mengunjungi JDIH Bagian Hukum Sukoharjo dengan harapan kegiatan ini bisa menjadi wadah berbagi pengalaman dan pengetahuan terkait pengelolaan Jaringan Dokumentasi dan Informasi Hukum (JDIH) kunjungan ini disambut langsung oleh Ketua Tim Pelaksana Kegiatan Dokumentasi dan Informasi Hukum Bagian Hukum Setda Sukoharjo Bapak Pizza Samudera, S.H, M.H. dalam sambutannya beliau menyampaikan apresiasi dan inisiatif JDIH Bagian Hukum Banjarnegara untuk melaksanakan kegiatan sharing atau berbagi pengalaman dan ilmu terkait pengelolaan JDIH sebagai langkah memperkuat sinergi dan peningkatan kualitas pengelolaan JDIH didaerah masing-masing.<p style=\"text-align: justify;\"><img width=\"410\" height=\"308\" src=\"/berita/image_1763365350_0.webp\"></p><p style=\"text-align: justify;\">Dalam kegiatan yang kita sebut sebagai sharing session ini Bapak Pizza Samudera memaparkan beberapa poin utama diantaranya adalah :&nbsp;</p><ol>\r\n<li>Penyampaian sarpras JDIH Sukohajo meliputi ruang kerja, ruang baca, ruang diskusi hingga sarana elektronik dan penunjang lainnya</li>\r\n<li>Pengenalan aplikasi informatif \"PIZZA HUD\" (Pusat Informasi Arsip Hukum dan Dokumentasi) sebagai sistem pelayanan terpadu berbasis digital</li>\r\n<li>Penjelasan SOP pengelolaan produk hukum daerah berbasis QR-Code yang menjadi bagian dari upaya digitalisasi dan transparansi pelayanan hukum</li>\r\n<li>Bedah fitur tracking SK serta e-koreksi</li>\r\n</ol><p style=\"text-align: justify;\">Kemudian dilanjutkan dengan sesi tanya jawab yang membahas berbagai aspek pengelolaan JDIH seperti penggunaan aplikasi QR-code, media penyimpanan digital \"Sukodrive\" serta saran dan masukan untuk pengelolaan JDIH Banjarnegara. Kegiatan ini ditutup dengan harapan agar kerja sama dan komunikasi antar kedua daerah dapat terus terjalin guna mendukung penguatan Jaringan Dokumentasi dan Informasi Hukum yang transparan, inovatif dan mudah diakses oleh masyarakat.&nbsp;</p></p>\n',NULL,'96f5f7bd-d2e7-4fa5-988f-384a582ca881.webp',47,'list','Imam','2025-11-17 07:42:31',1,'2025-10-20'),
(47,NULL,'FGD Pengelolaan Website JDIH','FGD Pengelolaan Website JDIH','fgd-pengelolaan-website-jdih','<p style=\"text-align: justify;\">Tegal 4 November 2025 - JDIH Bagian Hukum Setda Kab. Banjarnegara menghadiri Focus Group Discussion (FGD) pengelolaan website JDIH yang diselenggarakan oleh JDIH Biro Hukum Provinsi Jawa Tengah dengan tema \" Penguatan Infrastruktur Digital Dalam Rangka Optimalisasi Akses JDIH di Provinsi Jawa Tengah\". Kegiatan ini dilaksanakan selama dua hari dari tanggal 4-5 November 2025 bertempat di Gedung Hanggawana Kantor Samsat Kota Tegal FGD ini bertujuan untuk mengoptimalkan integrasi database anggota JDIH di Provinsi Jawa Tengah dengan pusat JDIH Nasional sekaligus memperkuat sinergi dalam penyelenggaraan layanan informasi hukum yang cepat, akurat dan mudah diakses oleh masyarakat.<p style=\"text-align: justify;\">Salah satu hal penting bagi pengelola JDIH adalah pengelolaan JDIH sesuai dengan standar teknis pengelolaan dokumentasi dan informasi hukum berbasis website yang merupakan sarana pembuatan, pembangunan dan pengelolaan standar minimal aplikasi JDIH yang bersifat dinamis untuk terciptanya keseragaman konten di pusat JDIH Nasional sebagai pusat database regulasi dan anggota JDIH Nasional pada Kementerian/Lembaga, Pemerintah Provinsi, Pemerintah Kabupaten/Kota dan Perpustakaan Hukum pada Perguruan Tinggi Negeri/swasta.</p><p style=\"text-align: justify;\">Dalam pengelolaan JDIH tidak jarang pengelola dihadapkan pada permasalahan khususnya terkait dengan pengelolaan website JDIH dalam pemenuhan standar pengelolaan yang sesuai standar sebagaimana diatur dalam ketentuan termasuk hingga bagian integrasi JDIH anggota kepada Pusat JDIH Nasional. Integrasi data merupakan suatu proses menghubungkan informasi hukum yang berasal dari sumber berbeda ke database Hukum Nasional. Sistem integrasi JDIH Nasional adalah sistem yang akan digunakan untuk mengumpulkan dokumen hukum dari semua anggota JDIH Nasional yaitu dengan melakukan pengambilan data berdasarkan log aktivitas database anggota (<em>create, update, delete</em>) dari server anggota ke server anggota JDIH Nasional yang berbasis metadata yang telah ditetapkan menggunakan API ( <em>Aplication Programing Interface</em> ) sehingga salah satu kewajiban anggota adalah melakukan Sync API secara berkala dan rutin.</p><p style=\"text-align: justify;\">Peran Dinas Komunikasi dan Informatika pada masing-masing anggota JDIH sangat penting dalam mendampingi para pengelola JDIH yang ada di wilayah Jawa Tengah mulai dari pemenuhan standar website, standar pengelolaan dokumen dan informasi hukum (melalui pemenuhan standar metadata dan pengisian metadata, integrasi JDIH serta pada saat terjadi serangan <em>cyber&nbsp;</em>website JDIH.</p><p style=\"text-align: justify;\">&nbsp;</p></p>\n',NULL,'182ac7ab-e27a-4cef-8d5f-472eeb44e3e9.webp',42,'list','Imam','2025-11-17 08:49:09',1,'2025-11-10'),
(48,NULL,'Kunjungan BPK Perwakilan Jawa Tengah Ke JDIH Kabupaten Banjarnegara','Kunjungan BPK Perwakilan Jawa Tengah Ke JDIH Kabupaten Banjarnegara','kunjungan-bpk-perwakilan-jawa-tengah-ke-jdih-kabupaten-banjarnegara','<p style=\"text-align: justify;\">Pada hari Rabu 19 November 2025 BPK Perwakilan Jawa Tengah mengunjungi JDIH Bagian Hukum Setda Kab. Banjarnegara dalam rangka pengumpulan produk hukum daerah (Peraturan Daerah dan Peraturan Bupati) serta melakukan diskusi dengan pengelola JDIH Banjarnegara. Kami selaku tim JDIH Banjarnegara mengucapkan terima kasih atas kunjungan Tim BPK Perwakilan Jawa Tengah dengan harapan kami bisa melakukan kunjungan balasan untuk sinergi pengelolaan Produk Hukum Daerah yang berkelanjutan.</p>\n',NULL,'a18df7f5-053c-424f-9280-8d024e45a842.webp',52,'list','Imam','2025-11-19 06:48:40',1,'2025-11-19'),
(49,NULL,'Bimbingan Teknis Penyusunan Produk Hukum Legal Drafting Di Lingkungan Komisi Pemilihan Umum (KPU) Kabupaten Banjarnegara Tahun 2025','Bimbingan Teknis Penyusunan Produk Hukum Legal Drafting Di Lingkungan Komisi Pemilihan Umum (KPU) Kabupaten Banjarnegara Tahun 2025','bimbingan-teknis-penyusunan-produk-hukum-legal-drafting-di-lingkungan-komisi-pemilihan-umum-(kpu)-kabupaten-banjarnegara-tahun-2025','<p style=\"text-align: justify;\">Banjarnegara 24 November 2025 bertempat pada Aula KPU Kabupaten Banjarnegara dilaksanakan Bimbingan Teknis terkait Penyusunan Produk Hukum Daerah yang diikuti seluruh pegawai KPU Kabupaten Banjarnegara, hadir sebagai narasumber dari Bagian Hukum Setda Argiyana Ratna Kumalasari S.H. Kegiatan ini menjadi bagian dari penguatan kapasitas internal KPU Kabupaten Banjarnegara dalam rangka meningkatkan kualitas penyusunan regulasi dan dokumen hukum di lingkungan KPU.<p style=\"text-align: justify;\"><img width=\"491\" height=\"276\" src=\"/berita/image_1764034573_0.webp\"></p><p style=\"text-align: justify;\">Acara dibuka oleh Ketua KPU Kabupaten Banjarnegara Mohamad Syarif Sapto Wiyogo, yang dalam sambutannya menekankan pentingnya ketelitian, kepastian hukum serta konsistensi penyusunan setiap produk hukum yang dikeluarkan oleh KPU beliau juga menggarisbawahi bahwa penguatan kemampuan <em>Legal Drafting&nbsp;</em>merupakan kebutuhan mendesak dalam mendukung penyelenggaraan pemilu yang profesional dan akuntabel.</p><p style=\"text-align: justify;\">Kemudian kegiatan dilanjutkan dengan arahan dari seluruh ketua Divisi KPU Kabupaten Banjarnegara yang menyampaikan pentingnya kolaborasi lintas divisi dalam memastikan setiap regulasi internal tersusun secara tepat dan sesuai ketentuan perundang-undangan. Mengusung format talk show kegiatan ini dipandu oleh Ratna Wulandari Agustiningsih sebagai moderator.</p><p style=\"text-align: justify;\">Dalam paparannya narasumber menyampaikan materi komperehensif mengenai dasar-dasar penyusunan peraturan perundang-undangan termasuk asas legalitas, hierarki regulasi, perbedaan peraturan dan keputusan, kaidah bahasa hukum, serta sistematika penulisan mulai dari konsiderans, batang tubuh hingga ketentuan penutup. Peserta juga diberikan contoh-contoh penyusunan peraturan dan keputusan KPU serta pembahsan mengenai teknik merumuskan norma hukum yang lugas, tidak ambigu dan memenuhi prinsip kepastian hukum.</p><p style=\"text-align: justify;\">Narasumber juga menekankan pentingnya konsistensi penggunaan istilah, ketepatan struktur dan larangan pendelegasian kewenangan yang bersifat blanko. Seluruh materi didukung dengan contoh konkret dan praktik umum yang berlaku dalam penyusunan produk hukum daerah maupun produk hukum KPU. Kegiatan ini berlangsung interaktif ditandai dengan berbagai pertanyaan dan diskusi dari peserta terkait penerapan teknis <em>Legal Drafting&nbsp;</em>pada produk hukum yang sering disusun di lingkungan KPU Kabupaten Banjarnegara.</p><p style=\"text-align: justify;\">&nbsp;</p><p>&nbsp;</p></p>\n',NULL,'9bf7e501-6c7a-4eba-9fde-65f4bf012ced.webp',65,'list','Imam','2025-11-25 01:36:13',1,'2025-11-25'),
(50,NULL,'Forum Satu Data Indonesia Kabupaten Banjarnegara\r\n\'\'Perencanaan Berbasis Data\'\'','Forum Satu Data Indonesia Kabupaten Banjarnegara\r\n\'\'Perencanaan Berbasis Data\'\'','forum-satu-data-indonesia-kabupaten-banjarnegara-\'\'perencanaan-berbasis-data\'\'','<p style=\"text-align: justify;\">Banjarnegara - Forum Satu Data Indonesia Tingkat Daerah Kabupaten Banjarnegara diselenggarakan pada hari Kamis, 27 November 2025 yang bertempat di Aula Sasana Bhakti Praja, Sekretariat Daerah Kabupaten Banjarnegara, sehubungan dengan pelaksanaan Peraturan Bupati Banjarnegara Nomor 26 Tahun 2021 tentang Satu Data Indonesia Daerah.<p>Sebegaimana tema Perencanaan Berbasis Data, forum yang dihadiri oleh berbagai intansi mulai dari Organisasi Pemerintah Daerah (OPD) hingga Instansi Vertikal menjadi wadah strategis untuk menyinergikan langkah perencaan dan pengambilan kebijakan berbasis data.</p><p style=\"text-align: justify;\">Satu Data Indonesia Daerah merupakan kebijakan tata kelola Data Pemerintah Daerah untuk menghasilkan Data yang akurat, mutakhir, terpadu, dan dapat dipertanggungjawabkan, serta mudah di akses dan dibagipakaikan antar Instansi Pusat dan Instansi Daerah melalui pemenuhan Standar Data, Metadata, Interoperabilitas, dan menggunakan Kode Referensi dan Data Induk.</p></p>\n',NULL,'WhatsApp Image 2025-11-28 at 08.25.44 (1).webp',44,'list','Tia','2025-11-28 01:54:18',1,'2025-11-28'),
(52,NULL,'Penandatanganan MOU Dengan Kejaksaan Negeri Terkait Pelaksanaan Pidana Kerja Sosial','Penandatanganan MOU Dengan Kejaksaan Negeri Terkait Pelaksanaan Pidana Kerja Sosial','penandatanganan-mou-dengan-kejaksaan-negeri-terkait-pelaksanaan-pidana-kerja-sosial','<p style=\"text-align: justify;\">Senin (1/12/2025) Pemerintah Provinsi Jawa Tengah menandatangani Nota Kesepahaman (MOU) mengenai pelaksanaan pidana kerja sosial di Kompleks Gubernuran Gedung Gradhika Bhakti Praja Kota Semarang. Mou ini juga melibatkan para Kepala Kejaksaan Negeri dengan Bupati/Walikota se-Provinsi Jawa Tengah yang mengatur berbagai aspek termasuk koordinasi teknis, penyediaan lokasi kerja sosial, pembinaan, pengawasan, penyediaan data serta sosialisasi kepada masyarakat.<p style=\"text-align: justify;\">Mou ini dilatarbelakangi sebagai implementasi Undang-Undang Nomor 1 Tahun 2023 Tentang KUHP yang akan berlaku pada 2 Januari 2026. Yurisdiksi kerja sosial berada pada kewenangan Bupati dan Wali Kota sehingga koordinasi dan pengawasan harus diperketat, kepala daerah harus memastikan tempat kerja sosial itu harus bermanfaat, tidak merendahkan martabat, dan tidak dikomersilkan. Pengawasan melekat ada di daerah dan pelaksanaannya wajib dilaporkan pada kejaksaan negeri setempat serta pemerintah daerah tidak diperbolehkan membiarkan lokasi kerja sosial digunakan secara transaksional atau menyimpang. Ini penting karena menyangkut asas keadilan bagi terpidana dan kepercayaan publik terhadap sistem hukum.</p><p><img src=\"../../berita/image_1765165003_0.webp\" width=\"499\" height=\"374\"></p><p style=\"text-align: justify;\">Plt Sekretaris Jaksa Agung Muda Bidang Tindak Pidana Umum (Jampidum) Undang Mogupal menegaskan bahwa implementasi KUHP baru memerlukan kesiapan dari masing-masing daerah. Pidana Kerja Sosial masuk kedalam pidana pokok pada KUHP baru, ia juga menegaskan bahwa hakim nantinya akan mencantumkan masa pidana kerja sosial sementara bentuk kegiatan akan disesuaikan dengan kondisi pemerintah daerah. Pidana Kerja Sosial diharapkan menjadi solusi untuk mengurangi overkapasitas pada Lembaga Pemasyarakatan (Lapas). Selain itu pidana kerja sosial ini juga memberikan ruang bagi terpidana untuk mengasah keterampilan mereka sehingga dapat kembali sebagai individu yang produktif.</p><p style=\"text-align: justify;\">Gubernur Jawa Tengah Komjen Pol (Purn) Ahmad Lutfi dalam sambutannya menyatakan bahwa pidana kerja sosial ini merupakan bagian penting dari konsep&nbsp;<em>Restorative Justice&nbsp;</em>yang lebih humanis. \"Ini bukan sekedar hukuman tetapi cara agar terpidana memahami kesalahannya dan memperbaiki diri melalui kontribusi kepada masyarakat\". Dengan MOU ini diharapkan pelaksanaan pidana kerja sosial dapat berjalan efektif dan memberikan manfaat bagi masyarakat serta pelaku yang menjalani hukuman.</p></p>\n',NULL,'WhatsApp Image 2025-12-08 at 10.25.38.webp',43,'list','Imam','2025-12-08 03:36:45',1,'2025-12-02'),
(53,NULL,'Study Referensi Pelaksanaan Tugas pada Bagian Hukum Sekretariat Daerah Kabupaten Temanggung','Study Referensi Pelaksanaan Tugas pada Bagian Hukum Sekretariat Daerah Kabupaten Temanggung','study-referensi-pelaksanaan-tugas-pada-bagian-hukum-sekretariat-daerah-kabupaten-temanggung','<p style=\"text-align: justify;\">Bagian Hukum Sekretariat Daerah Kabupaten Banjarnegara melaksanakan kegiatan studi referensi dalam rangka meningkatkan kualitas pelaksanaan tugas dan fungsi Bagian Hukum, khususnya di bidang peraturan perundang-undangan, bantuan hukum, serta dokumentasi dan informasi hukum.<p style=\"text-align: justify;\">Kegiatan studi referensi ini bertujuan untuk memperoleh gambaran dan praktik terbaik (best practices) terkait penyusunan produk hukum daerah, harmonisasi dan fasilitasi rancangan peraturan, serta pengelolaan Jaringan Dokumentasi dan Informasi Hukum (JDIH). Selain itu, kegiatan ini juga menjadi sarana untuk memperkuat pemahaman aparatur terhadap dinamika regulasi dan tata kelola pemerintahan yang sesuai dengan ketentuan peraturan perundang-undangan.</p><p style=\"text-align: justify;\">Melalui studi referensi, Bagian Hukum Setda Kabupaten Banjarnegara memperoleh masukan strategis terkait peningkatan efektivitas koordinasi dengan perangkat daerah, optimalisasi peran Bagian Hukum dalam pendampingan hukum, serta penerapan inovasi pelayanan hukum kepada masyarakat dan perangkat daerah.</p><p style=\"text-align: justify;\">Hasil dari kegiatan ini diharapkan dapat menjadi bahan evaluasi dan rekomendasi dalam penyempurnaan pelaksanaan tugas Bagian Hukum, sehingga mampu mendukung terwujudnya tata kelola pemerintahan daerah yang tertib hukum, akuntabel, dan berorientasi pada pelayanan publik yang berkualitas.</p></p>\n',NULL,'WhatsApp Image 2025-12-09 at 09.28.25.webp',19,'list','Tia','2025-12-23 03:15:12',1,'2025-12-08');
