INSERT INTO `profile_jdih` VALUES
(2,'<h2><strong>&ndash; Visi Bagian Hukum</strong></h2>\r\n<h5>&ldquo;Profesional dan Proporsional dalam penyusunan produk hukum daerah, pemberian bantuan hukum dan hak asasi manusia,pelayanan informasi dan dokumentasi hukum serta pengawasan produk hukum daerah kabupaten/kota&rdquo;</h5>\r\n<p>&nbsp;</p>\r\n<h2><strong>&ndash; Misi Bagian Hukum</strong></h2>\r\n<h5>1. Menyusun Produk Hukum daerah selaras dengan kepentingan umum, peraturan perundang- undangan yang lebih tinggi dan/atau peraturan perundang-undangan lainnya serta harmonisasi dengan produk hukum setingkat.</h5>\r\n<h5>2. Menyelesaikan penanganan perkara dan pemberian bantuan dan perlindungan hukum berdasarkan kepastian hukum, berazaskan kebenaran dan keadilan.</h5>\r\n<h5>3. Melayani informasi dan dokumentasi hukum.</h5>\r\n<h5>4. Mewujudkan sumber daya manusia yang profesional dan handal di bidang hukum</h5>','visimisi'),
(3,'<div class=\"card-header border-0 py-10 d-flex flex-column\"><center>\r\n<div class=\"card-header border-0 py-10 d-flex flex-column\"><center>\r\n<h1>DASAR HUKUM</h1>\r\n</center></div>\r\n<div class=\"card-body d-flex flex-column\">\r\n<div class=\"mt-5\">\r\n<p style=\"text-align: justify;\">PERATURAN PRESIDEN NOMOR 33 TAHUN 2012 TENTANG JARINGAN DOKUMENTASI DAN INFORMASI HUKUM NASIONAL;<br><br>PERATURAN MENTERI DALAM NEGERI NOMOR 2 TAHUN 2014 TENTANG PENGELOLAAN JARINGAN DOKUMENTASI DAN INFORMASI HUKUM KEMENTERIAN DALAM NEGERI DAN PEMERINTAH DAERAH;<br><br>PERATURAN MENTERI HUKUM DAN HAM NOMOR 8 TAHUN 2019 TENTANG STANDAR PENGELOLAAN DOKUMEN DAN INFORMASI HUKUM;<br><br><br>PERATURAN BUPATI BANJARNEGARA NOMOR 43 TAHUN 2023 TENTANG JARINGAN DOKUMENTASI DAN INFORMASI HUKUM;<br><br>KEPUTUSAN BUPATI BANJARNEGARA NOMOR 100.3/39 TAHUN 2024 TENTANG TIM PENGELOLAAN JARINGAN DOKUMENTASI DAN INFORMASI HUKUM.</p>\r\n</div>\r\n</div>\r\n</center></div>','dasarhukum'),
(4,'<center>\r\n<h1>TUPOKSI BAGIAN HUKUM</h1>\r\n</center>\r\n<h1><span style=\"color: rgb(224, 62, 45);\">TUGAS POKOK</span></h1>\r\n<p>melaksanakan pengoordinasian penyusunan dan analisis kebijakan Daerah, pengoordinasian pelaksanaan tugas Perangkat Daerah, pemantauan dan evaluasi pelaksanaan kebijakan Daerah, membantu pelaksanaan tugas dan wewenang Gubernur sebagai wakil pemerintah pusat bidang hukum, pelayanan administratif dan pembinaan sumber daya ASN di bidang perundang-undangan, bantuan hukum dan hak asasi manusia dan pengawasan produk hukum daerah dan jaringan dokumentasi serta informasi hukum.</p>\r\n<p>&nbsp;</p>\r\n<h1><span style=\"color: rgb(224, 62, 45);\">FUNGSI</span></h1>\r\n<p>Pengoordinasian penyusunan dan analisis kebijakan Daerah di bidang perundang-undangan, bantuan hukum dan hak asasi manusia dan pengawasan produk hukum daerah, serta jaringan dokumentasi dan informasi hukum;</p>\r\n<p>Pengoordinasian pelaksanaan tugas Perangkat Daerah di bidang perundang- undangan, bantuan hukum dan hak asasi manusia dan pengawasan produk hukum daerah, serta jaringan dokumentasi dan informasi hukum;</p>\r\n<p>pemantauan dan evaluasi pelaksanaan kebijakan Daerah di bidang perundang- undangan, bantuan hukum dan hak asasi manusia dan pengawasan produk hukum daerah, serta jaringan dokumentasi dan informasi hukum;</p>\r\n<p>pengoordinasian pelaksanaan tugas dan wewenang Bupati sebagai wakil pemerintah provinsi bidang hukum;</p>\r\n<p>pelaksanaan pelayanan administratif dan pembinaan sumber daya ASN di bidang perundang-undangan, bantuan hukum dan hak asasi manusia dan pengawasan produk hukum daerah, serta jaringan dokumentasi dan informasi hukum;dan</p>\r\n<p>pelaksanaan tugas lain yang diberikan oleh Asisten Pemerintahan dan Kesejahteraan Rakyat</p>','tupoksi'),
(5,'<h1 style=\"text-align: center;\">KEDUDUKAN DAN ALAMAT</h1>\r\n<p>&nbsp;</p>\r\n<p>JDIH Kabupaten Banjarnegara,<br><br>Bagian Hukum SETDA Kabupaten Banjarnegara</p>\r\n<p>Lantai 2, Jalan A. Yani Nomor 16 Banjarnegara 591187, Jawa Tengah, Indonesia<br><br>Telpon : (0286) 591218<br><br>Fax : (0286) 591187<br><br>Email : jdih@banjarnegarakab.go.id</p>','kedudukan'),
(6,'<h1 style=\"text-align: center;\">STRUKTUR ORGANISASI<p style=\"text-align: center;\"><img src=\"../struktur/17339662130.png\" width=\"686\" height=\"386\"></p><p><img src=\"../struktur/17339687311.png\" width=\"801\" height=\"451\"></p><h5 style=\"text-align: center;\"><img src=\"../struktur/17339687312.png\" width=\"629\" height=\"627\"></h5><p>&nbsp;</p><p style=\"text-align: center;\">&nbsp;</p><p style=\"text-align: center;\">&nbsp;</p><p style=\"text-align: center;\">&nbsp;</p></h1>\n','struktur_organisasi'),
